INSERT INTO `item` VALUES (7,2,'分娩计划','/uploads/148490564052815.jpg',3800,'分娩计划由OBM生育教育顾问在孕期完成6个课时的生育教育核心课程，指导妈妈在分娩第一产程运用呼吸法及自由体位缓解宫缩疼痛，加快产程，帮助妈妈制定属于自己的分娩计划。\n','2017-11-28 22:05:19','\n                            \n                            \n                            \n                            \n                            \n                            \n                            \n                            \n                            \n                            \n                            \n                            \n                            \n                            \n                            <p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\">分娩计划由</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">OBM</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">生育教育顾问在孕期</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">完成</span><span lang=\"EN-US\" style=\"font-size:\n10.0pt;font-family:&quot;Bangla MN&quot;\">6</span><span style=\"font-size:10.0pt;\nfont-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\">个课时的生育教育核心家庭课程，指导妈妈在分娩第一产程运用呼吸法及自由体位缓解宫缩疼痛，加快产程，学习不必要的医疗干预会给妈妈和宝宝带来的风险，指导妈妈与宝宝肌肤接触及第一口奶。帮助妈妈制定属于自己的分娩计划，分娩时在线陪伴，给予妈妈支持和鼓励，在线指导第一时间的肌肤接触和晚断脐。</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\"><b>课程大纲</b>：</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">第一节：</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p><p style=\"margin-bottom: 0.0001pt;\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">了解胎教</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p><p style=\"margin-bottom: 0.0001pt;\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">认识自然分娩</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p><p style=\"margin-bottom: 0.0001pt;\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">讲解宫缩的意义</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p><p style=\"margin-bottom: 0.0001pt;\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">孕期紧急就医的情况</span></p><p style=\"margin-bottom: 0.0001pt;\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\"><br></span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom