;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">产后妈妈身体的变化</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p><p style=\"margin-bottom: 0.0001pt;\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">妈妈角色的转换</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p><p style=\"margin-bottom: 0.0001pt;\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">母乳喂养的顺利开始</span></p><p style=\"margin-bottom: 0.0001pt;\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">了解新生儿及其睡眠和喂养规律</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p>                                                                                                                                                                                                                                                                                                                                                                            ',1,'2017-11-28 22:05:19',0,''),(8,2,'产前运动','/uploads/148489536325696.jpg',12800,'产前运动由OBM孕产康复顾问结合妈妈的临床产科信息，根据生育教育的评估由孕产康复顾问制定产前运动计划。','2017-01-20 14:56:07','\n                            \n                            \n                            <p>产前运动由OBM孕产康复顾问结合妈妈的临床产科信息，根据生育教育的评估由孕产康复顾问制定产前运动计划。产前合理适当的运动有助于增加妈妈血液流动速度，为肌肉提供足够的营养，并且能为宝宝提供更充沛的氧气和营养，刺激宝宝大脑等器官的发育。锻炼腹肌，避免妈妈腹壁松弛导致的胎位不正和难产，并能缓解妈妈孕期紧张的情绪和身体变化带来的不适，提高睡眠质量，提高妈妈新陈代谢的速度，提升机体抵御疾病的能力。</p><p><br></p><p><b>此项服务16次为一周期并结合临床营养计划持续跟进2个月。</b></p>                                                                        ',1,'2017-01-20 14:56:07',NULL,''),(32,3,'分娩陪伴 Birt