10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\">产后康复由</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">OBM</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">孕产康复顾问根据妈妈产后康复情况进行一对一上门服务。由于妈妈孕期体内孕激素的分泌，身体各部位尤其骨盆区域的肌肉、韧带等结缔组织和关节都会出现松弛的变化，产后康复运动除了减重尽快恢复体形以外，增强腹部和骨盆底肌的收缩力，降低背痛和压力性尿失禁的风险，以及核心区域的收紧和肌肉张力的恢复也是非常重要的训练目标。另外从心里上也能让妈妈感觉更自信，愉悦精神，缓解产后忧郁症状。</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p>\n\n<span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\nZH-CN;mso-bidi-language:AR-SA\">此服务项目为</span><span lang=\"EN-US\" style=\"font-size:\n10.0pt;font-family:&quot;Bangla MN&quot;;mso-fareast-font-family:微软雅黑;mso-bidi-font-family:\n&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;\nmso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">60</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\nZH-CN;mso-bidi-language:AR-SA\">分钟</span><span lang=\"EN-US\" style=\"font-size:10.0pt;\nfont-family:&quot;Bangla MN&quot;;mso-fareast-font-family:微软雅黑;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\nZH-CN;mso-bidi-language:AR-SA\">/</span><span style=\"font-size:10.0pt;\nfont-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\nmso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">次</span><span style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;;mso-fareast-font-family:微软雅黑;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\nmso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\"> </span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\nZH-CN;mso-bidi-language:AR-SA\">，共</span><span lang=\"EN-US\" style=\"font-size:10.0pt;\nfont-family:&quot;Bangla MN&quot;;mso-fareast-font-family:微软雅黑;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\nZH-CN;mso-bidi-language:AR-SA\">16</span><span style=\"font-size:10.0pt;\nfont-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\nmso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">次，包含</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;;mso-fareast-font-family:\n微软雅黑;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\nmso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">2</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\nZH-CN;mso-bidi-language:AR-SA\">个月的临床营养跟踪.</span>',1,'2017-11-28 22:27:31',0,''),(38,4,'产褥期康复','/uploads/148490033723067.jpg',12800,'产褥期康复由OBM孕产康复顾问根据妈妈产后康复情况进行一对一上门服务。此服务项目为90分钟/次 ，共10次，包含42天的临床营养。','2017-11-28 22:15:18',NULL,-1,'2017-04-25 10:07:49',0,''),(39,5,'单独上门','/uploads/148490111148210.jpg',1000,'由OBM哺育顾问提供单次一对一上门哺育支持服务。评估妈妈奶量和宝宝衔乳姿势、纠正宝宝含乳/乳头混淆、根据宝宝喂养情况制定妈妈追奶计划、为在职妈妈的背奶给予支持、帮助妈妈建立母乳喂养信心、指导妈妈及家人进行新生儿护理，针对新生儿常见问题给予合计建议、完成服务跟踪报告。','2017-11-28 22:20:52','\n                            由OBM哺育顾问提供单次一对一上门哺育支持服务。评估妈妈奶量和宝宝衔乳姿势、纠正宝宝含乳/乳头混淆、根据宝宝喂养情况制定妈妈追奶计划、为在职妈妈的背奶给予支持、帮助妈妈建立母乳喂养信心、指导妈妈及家人进行新生儿护理，针对新生儿常见问题给予合计建议、完成服务跟踪报告。\n\n                                                ',-1,'2017-01-20 16:32:25',NULL,''),(40,1,'孕产临床营养支持','/uploads/148482121552919.jpg',7200,'临床营养计划由OBM临床营养博士团队针对妈妈的饮食习惯及临床信息，按照孕周时间制定营养餐食配比，严格控制孕期体重，均衡各营养素的有效补充，避免营养不良造成的医疗干预，防止巨大儿和孕期因过度补充带来的肥胖症从而降低因为肥胖及营养过剩或营养不足带来的疾病风险（例如：妊娠糖尿病、妊娠高血压、甲状腺问题等）。孕早期临床营养600元/周，12周起售。','2017-11-28 22:20:33','\n                            \n                            \n                            \n                            <p>临床营养计划由OBM临床营养博士团队针对妈妈的饮食习惯及临床信息，按照孕周时间制定营养餐食配比，严格控制孕期体重，均衡各营养素的有效补充，避免营养不良造成的医疗干预，防止巨大儿和孕期因过度补充带来的肥胖症从而降低因为肥胖及营养过剩或营养不足带来的疾病风险（例如：妊娠糖尿病、妊娠高血压、甲状腺问题等）。孕早期临床营养600元/周，12周起售。</p><p><br></p><p><br></p>                                                                                                ',1,'2017-11-28 22:20:33',0,''),(41,3,'孕晚期临床营养支持','/uploads/148482092147772.jpg',7200,'临床营养计划由OBM临床营养博士团队针对妈妈的饮食习惯及临床信息，按照孕周时间制定营养餐食配比，严格控制孕期体重，均衡各营养素的有效补充，避免营养不良造成的医疗干预，防止巨大儿和孕期因过度补充带来的肥胖症从而降低因为肥胖及营养过剩或营养不足带来的疾病风险（例如：妊娠糖尿病、妊娠高血压、甲状腺问题等）。孕晚期由于宝宝需求的营养素越来越大，而母体会自动优先给予胎儿补给，如果不能及时均衡营养素的补充则会给孕妈妈来带营养不良的系列反应，从而影响胎儿。（例如常见的缺铁、缺钙等，如果采取综合营养素的补充，又容易造成部分营养素补充过量，带来其他营养素不吸收或身体不适，引发病理性反应。）孕晚期临床营养600元/周，12周起售。','2017-11-28 22:19:18','\n                            \n                            \n                            \n                            <div>临床营养计划由OBM临床营养博士团队针对妈妈的饮食习惯及临床信息，按照孕周时间制定营养餐食配比，严格控制孕期体重，均衡各营养素的有效补充，避免营养不良造成的医疗干预，防止巨大儿和孕期因过度补充带来的肥胖症从而降低因为肥胖及营养过剩或营养不足带来的疾病风险（例如：妊娠糖尿病、妊娠高血压、甲状腺问题等）。孕晚期由于宝宝需求的营养素越来越大，而母体会自动优先给予胎儿补给，如果不能及时均衡营养素的补充则会给孕妈妈来带营养不良的系列反应，从而影响胎儿。（例如常见的缺铁、缺钙等，如果采取综合营养素的补充，又容易造成部分营养素补充过量，带来其他营养素不吸收或身体不适，引发病理性反应。）孕晚期临床营养600元/周，12周起售。<br></div>\n\n                                                                                                                        ',-1,'2017-03-21 00:00:27',0,''),(42,5,'家庭成长计划','/uploads/148481711032951.jpg',16888,'了解原生家庭情况，关注隔代教育，1-12 个月宝宝心理成长和家庭成长，哺育顾问联合家庭成长顾问提供包含了辅食添加、1-6 个月喂养及背奶、离乳、早期的大运动发展、家庭游戏及后期的宝宝成长观察及家庭课堂。包含 18 次家庭课堂及一对一服务。 ','2017-04-07 20:29:50','\n                            \n                            \n                            \n                            \n                            <div>了解原生家庭情况，关注隔代教育，1-12 个月宝宝心理成长和家庭成长，哺育顾问联合家庭成长顾问提供包含了辅食添加、1-6 个月喂养及背奶、离乳、早期的大运动发展、家庭游戏及后期的宝宝成长观察及家庭课堂。包含 18 次家庭课堂及一对一服务。&nbsp;</div><div><br></div><div>关于宝宝：1-6个月喂养、辅食添加、感知觉发展、语言发展、动作发展、小肌肉发展、依恋发展</div><div><br></div><div><b>关于家庭：家庭排位、产后抑郁情绪、心理建设、关注原生家庭、正面沟通、生活及教育</b></div><div><br></div>\n\n                                                                                                                                                ',1,'2017-04-07 20:29:50',2,''),(43,5,'Baby Care','/uploads/148489768259017.jpg',12000,'OBM哺育团队联合家庭成长团队跟进宝宝1-12个月的哺育、护理及家庭成长，包括哺育支持、辅食添加、大运动发展、家庭游戏儿科体检等','2017-11-28 22:06:29','\n                            \n                            \n                            \n                            OBM哺育团队联合家庭成长团队跟进宝宝1-12个月的哺育、护理及家庭成长，包括哺育支持、辅食添加、大运动发展、家庭游戏儿科体检等\n\n                                                                                                                        ',-1,'2017-01-20 16:50:42',22,''),(44,5,'哺育康复计划','/uploads/148490239490642.jpg',9888,'哺育康复计划由OBM国际泌乳顾问团队和产后康复顾问从产后72小时开始跟踪服务，提供6次上门一对一哺育支持和6次产后康复服务。','2017-11-28 22:00:39','\n                            <div>哺育康复计划由OBM国际泌乳顾问团队和产后康复顾问从产后72小时开始跟踪服务，提供&nbsp;<font color=\"#ff0000\"><b>6&nbsp;</b></font>次上门一对一哺育支持和&nbsp;<span style=\"font-weight: bolder; color: rgb(255, 0, 0);\">6&nbsp;</span>次产后康复服务。</div><div><br></div><div><b>哺育支持</b>：评估妈妈奶量和宝宝衔乳姿势、纠正宝宝乳头混淆、制定妈妈追奶计划、为在职妈妈的背奶给予支持、帮助妈妈建立母乳喂养信心</div><div><b>康复计划</b>：据妈妈产后康复情况进行一对一上门服务，帮助妈妈减重尽快恢复体形，增强腹部和骨盆底肌的收缩力，降低背痛和压力性尿失禁的风险，恢复核心区域的收紧和肌肉张力，帮助妈妈建立信心，缓解产后忧郁症状。</div>\n\n                                                ',-1,'2017-01-20 17:27:51',4,''),(45,1,'Clinical Nutrition Care','/uploads/148958561421219.jpg',18888,'从孕早期开始配置私人临床营养顾问，根据妈妈的个人的BMI以及基础代谢结合临床产检及体检报告，私人订制各营养素的摄入配比。完成孕妈妈在孕期至产后42天的临床营养跟踪服务。旨在于保证妈妈及胎儿的营养摄入均衡，控制妈妈体重，进一步避免巨大儿给自然分娩带来更大的挑战。真正意义上做到长胎不长肉，为产后体形修复“保驾护航”。','2017-03-20 23:27:40','\n                            从孕早期开始配置私人临床营养顾问，根据妈妈的个人的BMI以及基础代谢结合临床产检及体检报告，私人订制各营养素的摄入配比。完成孕妈妈在孕期至产后42天的临床营养跟踪服务。旨在于保证妈妈及胎儿的营养摄入均衡，控制妈妈体重，进一步避免巨大儿给自然分娩带来更大的挑战。真正意义上做到长胎不长肉，为产后体形修复“保驾护航”。                        ',1,'2017-03-20 23:27:40',24,''),(46,1,'欧贝尔曼42天关爱-精选','/uploads/149044847524035.jpg',19888,'欧贝尔曼42天关爱-精选  从孕期开始4大团队（生育教育顾问 国际母乳顾问  临床营养顾问 康复顾问）持续跟进服务。\n\n家访计划：孕中晚期提供1次家访服务。内容主要包括妈妈的分娩计划审核、第一口奶及科学坐月子及待产包的讲解……\n生育教育：完成6个课时的生育教育核心课程、完成分娩计划书避免不必要的医疗干预。\n哺育支持：完成产后72小时的母乳、新生儿黄疸、生理性乳涨等服务以及产褥期的哺育支持及0-6个月的喂养支持。\n临床营养计划：持续跟踪妈妈孕期的临床营养信息，指导如何有效的控制体重，避免巨大儿分娩带来的额外负担，完成产后42天的临床饮食计划（每周根据临床信息变换）。\n康复计划：孕产康复顾问在产后第一时间指导完成康复训练。\n全时段咨询：订购欧贝尔曼42天关爱-精选的妈妈都将拥有一个自己的独立服务群，管家及4大团队的老师都将在群内随时解答您的疑惑，满足您的第一需求。\n管家服务：配备独立的管家带领4大团队完成基础服务，以满足您的第一需求为己任。\n','2017-04-07 15:57:14','\n                            \n                            \n                            \n                            \n                            <div>\n\n\n\n\n\n\n<!--[if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Revision>0</o:Revision>\n  <o:TotalTime>0</o:TotalTime>\n  <o:Pages>1</o:Pages>\n  <o:Words>63</o:Words>\n  <o:Characters>363</o:Characters>\n  <o:Company>Oriendy Space Artist</o:Company>\n  <o:Lines>3</o:Lines>\n  <o:Paragraphs>1</o:Paragraphs>\n  <o:CharactersWithSpaces>425</o:CharactersWithSpaces>\n  <o:Version>14.0</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG></o:AllowPNG>\n </o:OfficeDocumentSettings>\n</xml><![endif]-->\n\n<!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>N