  <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]-->\n\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\ntable.MsoNormalTable\n	{mso-style-name:普通表格;\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\n	mso-para-margin:0cm;\n	mso-para-margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:Cambria;\n	mso-ascii-font-family:Cambria;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Cambria;\n	mso-hansi-theme-font:minor-latin;\n	mso-font-kerning:1.0pt;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p class=\"MsoNormal\" align=\"left\">欧贝尔曼<span lang=\"EN-US\">42</span>天关爱<span lang=\"EN-US\">-</span>精选<span lang=\"EN-US\">&nbsp;&nbsp;</span>从孕期开始<span lang=\"EN-US\">4</span>大团队（生育教育顾问 国际母乳顾问<span lang=\"EN-US\">&nbsp;\n</span>临床营养顾问 康复顾问）持续跟进服务。<span lang=\"EN-US\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" align=\"left\">家访计划：孕中晚期提供<span lang=\"EN-US\">1</span>次家访服务。内容主要包括妈妈的分娩计划审核、第一口奶及科学坐月子及待产包的讲解<span lang=\"EN-US\">……</span><span lang=\"EN-US\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" align=\"left\">生育教育：完成<span lang=\"EN-US\">6</span>个课时的生育教育核心课程、完成分娩计划书避免不必要的医疗干预。<span lang=\"EN-US\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" align=\"left\">哺育支持：完成产后<span lang=\"EN-US\">72</span>小时的母乳、新生儿黄疸、生理性乳涨等服务以及产褥期的哺育支持及<span lang=\"EN-US\">0-6</span>个月的喂养支持。<span lang=\"EN-US\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" align=\"left\">临床营养计划：持续跟踪妈妈孕期的临床营养信息，指导如何有效的控制体重，避免巨大儿分娩带来的额外负担，完成产后<span lang=\"EN-US\">42</span>天的临床饮食计划（每周根据临床信息变换）。<span lang=\"EN-US\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" align=\"left\">康复计划：孕产康复顾问在产后第一时间指导完成康复训练。<span lang=\"EN-US\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" align=\"left\">全时段咨询：订购欧贝尔曼<span lang=\"EN-US\">42</span>天关爱<span lang=\"EN-US\">-</span>精选的妈妈都将拥有一个自己的独立服务群，管家及<span lang=\"EN-US\">4</span>大团队的老师都将在群内随时解答您的疑惑，满足您的第一需求。<span lang=\"EN-US\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\">管家服务：配备独立的管家带领<span lang=\"EN-US\">4</span>大团队完成基础服务，以满足您的第一需求为己任。<span lang=\"EN-US\"><o:p></o:p></span></p>\n\n<!--EndFragment--></div>\n\n                                                                                                                                                ',1,'2017-04-07 15:57:14',25,'');
