nt-family:&quot;Bangla MN&quot;\"> </span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">康复顾问、家庭成长顾问）持续跟进服务</span></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\"><b>家访计划</b>：孕期我们将根据妈妈的产检计划完成</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">7</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">次家访服务，服务内容主要针对妈妈的体重控制、自然分娩、体脂评估、产房布置、待产准备、哺育评估、家庭成长</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;\">……</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\"><b>生育教育</b>：完成</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">6</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">个课时的一对一生育教育核心课程、完成分娩计划书避免不必要的医疗干预。</span></p><p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\"><b>分娩陪伴</b>：完成</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">24</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">小时以内的分娩陪伴。</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\"><b>临床营养计划</b>：持续跟踪妈妈孕期的临床营养信息，指导如何有效的控制体重，避免巨大儿分娩带来的额外负担，完成孕期至产后</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">90</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">天的临床饮食计划（每周根据临床信息变换）。</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\"><b>产前运动</b>：孕产康复顾问在孕期给予妈妈16次的一对一孕产运动指导，改善妈妈体脂，减少因怀孕带来的不适、增加产道和骨盆肌肉的弹性，让分娩更加顺利。</span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\"><b>哺育支持</b>：完成产后</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">72</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">小时的第一口奶、新生儿黄疸、生理性乳涨等10次一对一服务以及产褥期的哺育支持及</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">0-6</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">个月的喂养支持</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\"><b>康复计划</b>：孕产康复顾问完成从产褥期至产后90天的26次产后康复一对一服务。</span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\"><b>儿科体检</b>：联合医疗机构全程关注完成宝宝</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">0-36</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">个月的体检报告。</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\"><b>家庭成长</b>：了解原生家庭情况</span><span style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"> &nbsp;</span><span style=\"font-size:10.0pt;\nfont-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\">了解养育过程的排位关系以及即将面临的挑战，关注隔代教育及宝宝</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"> 0-18月龄的</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">家庭成长计划，包含了宝宝早期的辅食添加、大运动发展、因果关系、物体恒存、家庭游戏等共计15次一对一服务。</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\"><b>全时段咨询</b>：订购</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">OBM CARE</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">的妈妈都将拥有一个自己的独立服务群，管家及</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">5</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">大团队的老师都将在群内随时解答您的疑惑，满足您的第一需求。</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:\n&quot;Bangla MN&quot;;mso-hansi-font-family:&quot;Bangla MN&quot;\"><b>管家服务</b>：配备独立的管家带领</span><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\">5</span><span style=\"font-size:10.0pt;font-family:微软雅黑;mso-ascii-font-family:&quot;Bangla MN&quot;;\nmso-hansi-font-family:&quot;Bangla MN&quot;\">大团队完成基础服务，以满足您的第一需求为己任。</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:10.0pt;font-family:&quot;Bangla MN&quot;\"><o:p></o:p></span></p>\n\n<!--EndFragment-->                                                                                                                                                                                                                                                                                                                                                                                                                                                ',1,'2017-06-20 15:37:10',3,'','START WITH THE SEED OF LOVE',24),(33,'欧贝尔曼42天关爱','/uploads/148462730588752.jpg',38888,'欧贝尔曼42天关爱-套餐','2017-06-20 15:35:00','\n                            \n                            \n                            \n                            \n                            \n                            \n                            \n                            \n                            \n\n\n\n\n\n\n\n<!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves></w:TrackMoves>\n  <w:TrackFormatting></w:TrackFormatting>\n  <w:PunctuationKerning></w:PunctuationKerning>\n  <w:DrawingGridVerticalSpacing>10 磅</w:DrawingGridVerticalSpacing>\n  <w:DisplayHorizontalDrawingGridEvery>0</w:Dis