INSERT INTO `message` VALUES (743,'text','求助，我朋友开到五指，到医院后宫缩不强烈，医生建议人工破膜。胎儿已入盆，一胎。如果破水后，宫缩仍不强烈是不是会挂催产，如果还不下来是不是回要破腹。','2017-01-21 19:57:23',NULL,131,'oLx6DjpVAUH6UckZuSznQ60prGTE','Johnwoo',1,1,182),(744,'text','你好，请稍等，正在回复','2017-01-21 19:59:27',NULL,131,'oLx6DjpVAUH6UckZuSznQ60prGTE','Johnwoo',1,2,NULL),(745,'text','有研究表明破水后会短时间引发宫缩，但是有效期在15分钟左右','2017-01-21 20:01:56',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,2,NULL),(746,'text','妈妈自身心理状态对宫缩有影响，恐惧紧张有压力……都有可能令妈妈的肾上腺素升高从而抑制了自身催产素的分泌','2017-01-21 20:03:20',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,2,NULL),(747,'text','是不是不干预破水最好','2017-01-21 20:04:23',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','Johnwoo',1,1,NULL),(748,'text','如果破水后宫缩效果不佳，医院肯定有自己的医疗建议','2017-01-21 20:04:32',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,2,NULL),(749,'text','就怕这样，破水没反应就剖腹产/::~','2017-01-21 20:05:00',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,1,NULL),(750,'text','如果没有什么医学指标，妈妈和宝宝一切正常，为什么不尝试等待自己的宫缩呢','2017-01-21 20:05:25',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,2,NULL),(751,'text','嗯，好的。谢谢你无私的帮助/::)','2017-01-21 20:05:53',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,1,NULL),(752,'text','所以分娩的时候，有专业的分娩陪伴在旁边支持，可能会更好','2017-01-21 20:06:05',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,2,NULL),(753,'text','嗯','2017-01-21 20:06:19',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,1,NULL),(754,'text','包括孕期的提前学习，等到这个时候，真的怕是帮不上什么积极的忙/::~','2017-01-21 20:06:43',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,2,NULL),(755,'text','不客气/::>','2017-01-21 20:06:57',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,2,NULL),(756,'text','嗯，孕前学习很重要','2017-01-21 20:07:55',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,1,NULL),(757,'text','祝你朋友一切顺利/:rose','2017-01-21 20:08:16',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,2,NULL),(758,'text','嗯谢谢','2017-01-21 20:08:32',NULL,132,'oLx6DjpVAUH6UckZuSznQ60prGTE','songkena',1,1,NULL),(759,'text','咨询了套餐-<a href=\"http://wp.theob