身也会给予宝宝抵抗外界病毒的抗体','2017-01-22 10:01:15',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,2,NULL),(836,'text','我也真的是，不知道怎么搞的就发烧了','2017-01-22 10:01:47',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,1,NULL),(837,'text','没事的！放心大胆的喂！如果持续性高烧，还是需要去看医生的','2017-01-22 10:02:50',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,2,NULL),(838,'text','??','2017-01-22 10:03:33',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,1,NULL),(839,'text','/::P','2017-01-22 10:03:47',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,2,NULL),(840,'text','乳头上好像长了一颗小白泡，宝宝刚刚衔住乳房的时候会很疼，吸允的时候疼痛感会减少一点，这种情况怎么办？','2017-01-22 14:37:59',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg',NULL,1,1,187),(841,'text','是有小白点吗？','2017-01-22 14:39:05',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,2,NULL),(842,'text','是的','2017-01-22 14:39:49',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,1,NULL),(843,'text','其实就相当于脂肪粒一样，所以只有让宝宝把它吸出来才会不痛，这个过程可能会痛，但是宝宝吸出是最无害的','2017-01-22 14:40:26',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,2,NULL),(844,'text','注意饮食清淡，不要喝荤汤了，多饮水','2017-01-22 14:42:14',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,2,NULL),(845,'text','那要吸多久才能吸出来呀？','2017-01-22 14:42:35',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,1,NULL),(846,'text','不一定的，要看你小白点的情况，如果你不介意可以喂奶时间间隔稍微久一点，孩子饿的时候吸力比较大，先吃有小白点的这一边，而且有时候小白点是一串排列在乳腺管里，所以不一定的，每个人情况都不一样，所以如果在喝荤汤最好别喝了，多饮水','2017-01-22 14:45:37',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,2,NULL),(847,'text','我基本上按需喂养，可是有时候宝宝哭的很凶的时候，月嫂就直接说没吃饱，让我再喂，但是这样间隔时间就会比较短，宝宝也吸不好。','2017-01-22 14:53:54',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,1,NULL),(848,'text','另外，感觉现在的奶量也不算很够，宝宝月子里22天，一次可以吃70-85ml，尿量一天有6次以上，大便多的时候一天7-8泡，量很多，至少半个尿不湿的量；这几天次数变少了，但是也有4-5泡，量少的一个汤匙的量，量多的也是有满满一个尿不湿。晚上夜奶的次数基本上是2小时一次','2017-01-22 14:54:32',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,1,NULL),(849,'text','吃饱吃不饱主要看尿量和?的量，宝宝出生多少天','2017-01-22 14:55:27',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,2,NULL),(850,'text','浑汤我喝的时候也都基本把油撇掉了，水一天能保证2000ml的量','2017-01-22 14:56:53',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,1,NULL),(851,'text','宝宝今天是22天','2017-01-22 14:57:01',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,1,NULL),(852,'text','尿量每天都在6次以上','2017-01-22 14:58:35',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,1,NULL),(853,'text','按照你说的你的孩子吃的不错，所以跟家人和月嫂的沟通只能靠你自己，小白泡的处理方式我前面已经说了，如果你自己还是处理不了可以约我们的国际母乳顾问上门服务','2017-01-22 14:59:41',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,2,NULL),(854,'text','好的，谢谢～','2017-01-22 15:00:44',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,1,NULL),(855,'text','不客气','2017-01-22 15:00:53',NULL,136,'oLx6DjpfcCkd78kDjUl3X-PnjBvg','Johnwoo',1,2,NULL),(856,'text','你好','2017-01-22 15:56:19',NULL,134,'oLx6Djg9-K65bOXLtHXM5ms8_70c','Johnwoo',1,1,188),(857,'text','你好','2017-01-22 15:56:44',NULL,134,'oLx6Djg9-K65bOXLtHXM5ms8_70c','Johnwoo',1,2,NULL),(858,'text','我想咨询下剖宫产后，到底用收腹带好不好','2017-01-22 15:57:06',NULL,134,'oLx6Djg9-K65bOXLtHXM5ms8_70c','Johnwoo',1,1,NULL),(859,'image','[图片消息]','2017-01-22 15:57:18','1F0mOr1mqQpqz2QwRDuMcjI9nUh80mW_-PQgTPQiCEqfDtECVKBspQzwGZ6waKXw.jpg',134,'oLx6Djg9-K65bOXLtHXM5ms8_70c','Johnwoo',1,1,NULL),(860,'image','[图片消息]','2017-01-22 15:57:22','WmOBviIpAr-sdwwpUEsy569ZS5fwfsz7UTwQLo2GhQfFS44xMvOsNk0gD5gdXTVH.jpg',134,'oLx6Djg9-K65bOXLtHXM5ms8_70c','Johnwoo',1,1,NULL),(861,'image','[图片消息]','2017-01-22 15:57:24','WmOBviIpAr-sdwwpUEsy569ZS5fwfsz7UTwQLo2GhQfFS44xMvOsNk0gD5gdXTVH.jpg',134,'oLx6Djg9-K65bOXLtHXM5ms8_70c','Johnwoo',1,1,NULL),(862,'text','这种观点对吗？','2017-01-22 15:57:32',NULL,134,'oLx6Djg9-K65bOXLtHXM5ms8_70c','Johnwoo',1,1,NULL),(863,'text','收腹带的作用不是收腹','2017-01-22 15:57:38',NULL,134,'oLx6Djg9-K65bOXLtHXM5ms8_70c','Johnwoo',1,2,NULL),(864,'text','说不要绑腹带','2017-01-22 15:57:39',NULL,134,'oLx6Djg9-K65bOXLtHXM5ms8_70c','Johnwoo',1,1,NULL),(865,'text','它主要作用是绑缚胯骨','2017-01-22 15:58:20',NULL,134,'oLx6Djg9-K65bOXLtHXM5ms8_70c','Johnwoo',1,2,NULL),(866,'text','但是很多是说绑在腹部上','2017-01-22 15:58:47',NULL,134,'oLx6Djg9-K65bOXLt