wknm8frW4',NULL,1,1,267),(2284,'text','宝宝六个月开始添加辅食，没有什么固定的顺序，但是一般先从米粉和蛋黄开始，然后肉，菜，水果，开始的没有固定的量，是为了让孩子开始适应辅食，所以一开始吃的不会多，还是以母乳为主的','2017-02-20 22:05:50',NULL,201,'oLx6DjoVRK8J8jy_CyTwknm8frW4','Johnwoo',1,2,NULL),(2285,'text','为什么肉在菜和水果前面，它也不易消化呀','2017-02-20 22:07:34',NULL,201,'oLx6DjoVRK8J8jy_CyTwknm8frW4','Johnwoo',1,1,NULL),(2286,'text','因为要补铁，一般肉菜没有特殊顺序但是一次一般加一种食物，观察一段时间看看是否过敏，再添加另外一种','2017-02-20 22:09:05',NULL,201,'oLx6DjoVRK8J8jy_CyTwknm8frW4','Johnwoo',1,2,NULL),(2287,'text','知道了，谢谢','2017-02-20 22:10:29',NULL,201,'oLx6DjoVRK8J8jy_CyTwknm8frW4','Johnwoo',1,1,NULL),(2288,'text','您好，宝宝吃母乳，一直消化不良，大便次数多，不成形还带有水，医生说是对奶类不耐受，请问有没有办法改变这个它','2017-02-21 09:30:20',NULL,202,'oLx6DjqDO32Vm9xMhA2s1LCxq_sM',NULL,1,1,268),(2289,'text','母乳宝宝的正常便便是比较稀软的，次数也会比较多，因为比较好消化。具体有照片吗？','2017-02-21 09:35:34',NULL,202,'oLx6DjqDO32Vm9xMhA2s1LCxq_sM','zhaodan',1,2,NULL),(2290,'image','[图片消息]','2017-02-21 09:54:38','Vhf5pd6a3oKxYZ1aqi07Ru0YYchmkw0Ls5zJ-TrddMFAxtaDyyZX2RGiYnDbSBQv.jpg',202,'oLx6DjqDO32Vm9xMhA2s1LCxq_sM','zhaodan',1,1,NULL),(2291,'image','[图片消息]','2017-02-21 09:54:41','uev4dAfq9BRfzwDkNk0rKBz3XTejy0oPXY9dzBvVwW9ez3MCzul7kh3yNEx3k_uf.jpg',202,'oLx6DjqDO32Vm9xMhA2s1LCxq_sM','zhaodan',1,1,NULL),(2292,'text','因为有肛周脓肿，所以医生不让拉肚子，','2017-02-21 09:55:06',NULL,202,'oLx6DjqDO32Vm9xMhA2s1LCxq_sM','zhaodan',1,1,NULL),(2293,'text','不吃思密达拉的是蓝色布上那样，吃了思密达大便里有青绿色颗粒','2017-02-21 09:55:47',NULL,202,'oLx6DjqDO32Vm9xMhA2s1LCxq_sM','zhaodan',1,1,NULL),(2294,'text','宝宝现在多大了？之前有用过什么药物吗？','2017-02-21 09:56:06',NULL,202,'oLx6DjqDO32Vm9xMhA2s1LCxq_sM','zhaodan',1,2,NULL),(2295,'text','四十天，刚出生因为缺氧在保温箱住十天，然后就是拉肚子医生开的药，','2017-02-21 09:57:28',NULL,202,'oLx6DjqDO32Vm9xMhA2s1LCxq_sM','zhaodan',1,1,NULL),(2296,'image','[图片消息]','2017-02-21 09:57:37','0_gxazTjgnBdmP3U0_Kdft6fgy4xgf94lcUaujvVxumnGZ_AyiT6v3TAgUEQ-s9x.jpg',202,'oLx6DjqDO32Vm9xMhA2s1LCxq_sM','zhaodan',1,1,NULL),(2297,'image','[图片消息]','2017-02-21 09:57:39','MYdwbYpfvGi-UvJJxp4qXgwoXN8Z0ngF394HAAvDLAjZhCVcflY8J1_x-X2NfP5O.jpg',202,'oLx6DjqDO32Vm9xMh