jia',1,1,NULL),(2314,'text','今天上午坚持了一天刚才忍不住给孩子喝了30毫升的奶粉，因为喂他母乳他吃两口就不吃了，上午的奶水比较充足，吃的可以，刚才他在吃的时候两个乳头都比较干，他就推开了，为什么他会拒绝母乳呢，难道是因为他之前都有喝奶粉今天不喝他会不适应还是……/::~','2017-02-23 17:16:27',NULL,203,'oLx6DjiSEe-jJQqVR3wRAJ59nK2M','daguanjia',1,1,NULL),(2315,'text','？','2017-02-23 20:20:23',NULL,203,'oLx6DjiSEe-jJQqVR3wRAJ59nK2M','daguanjia',1,1,NULL),(2316,'text','你可以适当的手挤奶湿润乳头试试','2017-02-23 20:22:33',NULL,203,'oLx6DjiSEe-jJQqVR3wRAJ59nK2M','daguanjia',1,2,NULL),(2317,'text','既然母乳够就不要添加奶粉，因为奶瓶吃奶更容易获得，这样会加速宝宝拒绝母乳','2017-02-23 20:24:59',NULL,203,'oLx6DjiSEe-jJQqVR3wRAJ59nK2M','daguanjia',1,2,NULL),(2318,'text','好的，母乳是我自己判断的，我挤奶发现还能挤出来，这样判断标准对吗','2017-02-23 20:27:11',NULL,203,'oLx6DjiSEe-jJQqVR3wRAJ59nK2M','daguanjia',1,1,NULL),(2319,'text','这个的判断应该看尿不湿每天的用量','2017-02-23 20:28:14',NULL,203,'oLx6DjiSEe-jJQqVR3wRAJ59nK2M','daguanjia',1,2,NULL),(2320,'text','嗯，尿不湿每天用量在标准内，下午给他喂了一个小时的母乳，他还是哭，还是要吃，两个乳房他吃到最后也不愿意吃了，然后就哭，吃了奶粉就不哭了，这是怎么回事呢','2017-02-23 20:31:04',NULL,203,'oLx6DjiSEe-jJQqVR3wRAJ59nK2M','daguanjia',1,1,NULL),(2321,'text','奶粉是因为宝宝吃的速度过快，升糖指数上涨，就吃“晕”了。就像我们大人吃饭过快 饭后就想睡觉一样的道理','2017-02-23 20:33:15',NULL,203,'oLx6DjiSEe-jJQqVR3wRAJ59nK2M','daguanjia',1,2,NULL),(2322,'text','准备顺产的妈妈需要预防意外剖宫产而预备针管之类收集初乳的器具吗？','2017-02-23 20:37:40',NULL,204,'oLx6DjlWOvGvZ311Ff4JgdMue6sQ',NULL,1,1,271),(2323,'text','不需要，针管的准备太方便了','2017-02-23 20:38:33',NULL,204,'oLx6DjlWOvGvZ311Ff4JgdMue6sQ','songkena',1,2,NULL),(2324,'text','如果生产医院有提供分娩导乐服务理应考虑吗？','2017-02-23 20:38:33',NULL,204,'oLx6DjlWOvGvZ311Ff4JgdMue6sQ','songkena',1,1,NULL),(2325,'text','医院里都有一次性针管啊','2017-02-23 20:38:49',NULL,204,'oLx6DjlWOvGvZ311Ff4JgdMue6sQ','songkena',1,2,NULL),(2326,'text','担心临时收集准备不充分','2017-02-23 20:39:42',NULL,204,'oLx6DjlWOvGvZ311Ff4JgdMue6sQ','songkena',1,1,NULL),(2327,'text','建议妈妈聘请分娩陪伴（导乐），只是建议最好之前就与分娩陪伴建立信任感，而不是临时找不认识的','2017-02-23 20:39:56',NULL,204,'oLx6DjlWOvGvZ311Ff4JgdMue6sQ','songkena',1,2,NULL),(2328,'text','你们提供远程导乐陪伴吗？','2017-02-23 20:40:21',NULL,204,'oLx6DjlWOvGvZ311Ff4JgdMue6sQ','songkena',1,1,NULL),(2329,'t