vZ311Ff4JgdMue6sQ','Johnwoo',1,1,NULL),(2347,'text','好的，你直接加obmcare 她会帮你预约','2017-02-23 20:51:53',NULL,205,'oLx6DjlWOvGvZ311Ff4JgdMue6sQ','Johnwoo',1,2,NULL),(2348,'text','已加','2017-02-23 20:52:43',NULL,205,'oLx6DjlWOvGvZ311Ff4JgdMue6sQ','Johnwoo',1,1,NULL),(2349,'text','[微笑]','2017-02-23 20:53:13',NULL,205,'oLx6DjlWOvGvZ311Ff4JgdMue6sQ','Johnwoo',1,2,NULL),(2350,'text','你好，请问宝儿为什么吃母乳各边吃了半个小时就好像没有吃饱一样，再吸他就不吸了，好像再说奶不够一样吃了又吐，嘴有再找奶吃，为什么呢，喂奶粉以后就安静了','2017-02-24 12:33:27',NULL,203,'oLx6DjiSEe-jJQqVR3wRAJ59nK2M','daguanjia',1,1,NULL),(2351,'text','我家孩子三个月，每天晚上凌晨四点后睡觉不踏实，哼唧，有时候哭，绕手。一会醒一会醒。怎么回事？','2017-02-24 13:00:34',NULL,206,'oLx6DjsvyEoC_J7IyYOyX-RITkm8',NULL,1,1,273),(2352,'text','孩子睡眠本来就不会像成人一样的，而且婴儿不会自我安抚，所以就喂奶帮孩子接觉','2017-02-24 13:07:49',NULL,206,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','haoweixin',1,2,NULL),(2353,'text','他睡半个小时或者十几分钟就开始蹬被子，烦躁，哼唧','2017-02-24 13:09:28',NULL,206,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','haoweixin',1,1,NULL),(2354,'text','那就看看会不会穿多了或者是盖多了太热了，孩子会烦躁睡不踏实','2017-02-24 13:10:22',NULL,206,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','haoweixin',1,2,NULL),(2355,'text','不是','2017-02-24 13:10:43',NULL,206,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','haoweixin',1,1,NULL),(2356,'text','你是怎么判断孩子是否穿的或者盖的多少的','2017-02-24 13:11:37',NULL,206,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','haoweixin',1,2,NULL),(2357,'text','穿一件薄秋衣，裤子不穿。','2017-02-24 13:16:26',NULL,206,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','haoweixin',1,1,NULL),(2358,'text','那还好，因为孩子的睡眠不会像成人一样一觉睡醒，浅睡眠从孩子闭眼就开始算，而且浅睡眠长脑子深睡眠长身体，所有的浅睡眠这种是在刺激神经元的发育，如果正好猛涨期的时候睡眠退化反复都是正常，家长久多担待，只要孩子的精神状态都不错就不用太过纠结','2017-02-24 13:24:08',NULL,206,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','haoweixin',1,2,NULL),(2359,'text','白天精神挺好。一到晚上就那种情况，眼睛闭着哼唧快哭了一样。我很担心是不是哪不舒服','2017-02-24 13:32:46',NULL,206,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','haoweixin',1,1,NULL),(2360,'text','你是为母乳吗？','2017-02-24 13:33:18',NULL,206,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','haoweixin',1,2,NULL),(2361,'text','如果喂上奶了孩子是不是会安定一点呢','2017-02-24 13:33:41',NULL,206,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','haoweixin',1,2,NULL),(2362,'text','对母乳。喂上有时候不