ZfvOgFUg','Johnwoo',1,1,NULL),(3987,'text','宝宝七个月了，湿疹反反复复，最近太阳好，出去散步晒了脸上一片一片红疹都出来了，有什么有效办法，或者还是得去医院？','2017-04-14 08:05:07',NULL,220,'oLx6Dju5WB7yEqwt9ipPxL1URr9M',NULL,1,1,368),(3988,'text','湿疹需要做到清洁➕保湿，而且保湿霜要厚涂，如果是真严重的话可以去医生那里看一下，一般医生会开激素药膏，擦了控制一下湿疹的情况，之后还是需要勤保湿，一天之内多擦几次','2017-04-14 10:38:28',NULL,220,'oLx6Dju5WB7yEqwt9ipPxL1URr9M','haoweixin',1,2,NULL),(3989,'text','至于晒太阳出红疹没看到人或者图片不能太确定是什么情况，有可能穿多了晒太阳出的红红的热疹，热疹只要凉快下来了就会退掉或者减弱，你可以参考一下','2017-04-14 10:38:42',NULL,220,'oLx6Dju5WB7yEqwt9ipPxL1URr9M','haoweixin',1,2,NULL),(3990,'text','湿疹靠晒太阳解决不了，反而热会加剧','2017-04-14 10:42:33',NULL,220,'oLx6Dju5WB7yEqwt9ipPxL1URr9M','haoweixin',1,2,NULL),(3991,'text','好的谢谢','2017-04-14 10:47:04',NULL,220,'oLx6Dju5WB7yEqwt9ipPxL1URr9M','haoweixin',1,1,NULL),(3992,'text','两个多月的宝宝母乳喂养大便次数大概一天几次正常啊','2017-04-14 17:13:39',NULL,152,'oLx6DjnH8aYbCD2VRqsr-M-iVOws',NULL,1,1,369),(3993,'text','一天几次和几天一次都是正常的，只要拉出来形状都是好的，就不用太担心','2017-04-14 17:20:44',NULL,152,'oLx6DjnH8aYbCD2VRqsr-M-iVOws','haoweixin',1,2,NULL),(3994,'text','宝宝现在一周一了。一直有轻度贫血，净重才17斤，偏瘦，饮食什么都好的，为什么就不长肉呢？会不会和贫血有关呢？','2017-04-17 07:43:52',NULL,271,'oLx6Djm29jP7YbFmIvejkUUjpnSk',NULL,1,1,370),(3995,'text','这么瘦有点着急呢。身高倒还好，差一公分','2017-04-17 07:44:54',NULL,271,'oLx6Djm29jP7YbFmIvejkUUjpnSk',NULL,1,1,370),(3996,'text','早上好','2017-04-17 07:47:16',NULL,271,'oLx6Djm29jP7YbFmIvejkUUjpnSk','caoqin',1,2,NULL),(3997,'text','请问你是怎么判断宝宝贫血的呢？','2017-04-17 07:47:35',NULL,271,'oLx6Djm29jP7YbFmIvejkUUjpnSk','caoqin',1,2,NULL),(3998,'text','查了血常规','2017-04-17 07:47:51',NULL,271,'oLx6Djm29jP7YbFmIvejkUUjpnSk','caoqin',1,1,NULL),(3999,'text','可能遗传我的，脸色不是很红润。但其他都好','2017-04-17 07:48:36',NULL,271,'oLx6Djm29jP7YbFmIvejkUUjpnSk','caoqin',1,1,NULL),(4000,'text','你觉得这么一丁点血能代表全身？','2017-04-17 07:48:51',NULL,271,'oLx6Djm29jP7YbFmIvejkUUjpnSk','caoqin',1,2,NULL),(4001,'text','这个我也不懂，医生说不长肉可能和贫血有关，建议我给宝宝吃补铁的','2017-04-17 07:49:41',NULL,271,'oLx6Djm29jP7YbFmIvejkUUjpnSk','caoqin',1,1,NULL),(4002,'text','宝宝出生体重多少？','2017-04-17 07:49:44',NULL,271,'oLx6Djm29jP7YbFmI