jia',1,1,NULL),(4020,'text','您那有专业的顾问吗？','2017-04-17 19:37:56',NULL,272,'oLx6DjrfhWgb0d3IqciPj8sFzNjA','daguanjia',1,1,NULL),(4021,'text','你好','2017-04-17 20:48:24',NULL,273,'oLx6DjgrUkKagGwvYOEV5reUkWqw',NULL,1,1,372),(4022,'text','我想咨询一下母乳不够吃喝汤不管用有没有别的办法啊','2017-04-17 20:49:28',NULL,273,'oLx6DjgrUkKagGwvYOEV5reUkWqw',NULL,1,1,372),(4023,'text','喝汤除了催肥并无催奶之效啊[嘿哈]母乳喂养成功与否因素很多，首先并不了解你的具体情况，月龄，喂养方式等等','2017-04-17 20:52:46',NULL,273,'oLx6DjgrUkKagGwvYOEV5reUkWqw','zhaodan',1,2,NULL),(4024,'text','喝汤除了催肥并无催奶之效啊[嘿哈]母乳喂养成功与否因素很多，首先并不了解你的具体情况，月龄，喂养方式等等','2017-04-17 20:53:39',NULL,273,'oLx6DjgrUkKagGwvYOEV5reUkWqw','zhaodan',1,2,NULL),(4025,'text','两个半月了','2017-04-17 20:53:41',NULL,273,'oLx6DjgrUkKagGwvYOEV5reUkWqw','zhaodan',1,1,NULL),(4026,'text','不好意思，因为你长时间未回复，后台咨询量很大。我先去解决其他妈妈的疑问了','2017-04-17 22:06:33',NULL,272,'oLx6DjrfhWgb0d3IqciPj8sFzNjA','daguanjia',1,2,NULL),(4027,'text','我们在苏州有分部，你可以加管家微信obmcare 联系预约','2017-04-17 22:07:27',NULL,272,'oLx6DjrfhWgb0d3IqciPj8sFzNjA','daguanjia',1,2,NULL),(4028,'text','儿童如厕','2017-04-19 12:41:55',NULL,274,'oLx6DjrZfT2YXoWm_TYRPmLkDw5M',NULL,1,1,373),(4029,'text','4','2017-04-19 12:42:27',NULL,274,'oLx6DjrZfT2YXoWm_TYRPmLkDw5M',NULL,1,1,373),(4030,'text','我每次喂奶，这边在喂，那边在流，怎么办？','2017-04-19 20:22:10',NULL,275,'oLx6DjntkmF5Jh5w0Zqy9px0jciQ',NULL,1,1,374),(4031,'text','因为喷乳反射是两边同时进行的，所以这样很正常。可以用手肘内侧（夹臂）或者用手掌按压一下乳房5-10秒就不会流了','2017-04-19 20:29:15',NULL,275,'oLx6DjntkmF5Jh5w0Zqy9px0jciQ','zhaodan',1,2,NULL),(4032,'text','谢谢','2017-04-19 20:29:40',NULL,275,'oLx6DjntkmF5Jh5w0Zqy9px0jciQ','zhaodan',1,1,NULL),(4033,'text','宝宝两个多月 一喝母乳就拉 现在还要五六次 有时候七八次～大便上次带血丝说有肠炎，后来又好了一周，这几天又有几丝～难道是母乳性腹泻？','2017-04-19 21:51:28',NULL,152,'oLx6DjnH8aYbCD2VRqsr-M-iVOws','haoweixin',1,1,NULL),(4034,'text','如果是病理性的，或者怀疑病理性的建议还是要去医院检查一下大便','2017-04-19 21:53:22',NULL,152,'oLx6DjnH8aYbCD2VRqsr-M-iVOws','haoweixin',1,2,NULL),(4035,'text','有没有母乳性腹泻的？万一要停母乳怎么办啊','2017-04-19 21:53:50',NULL,152,'oLx6DjnH8aYbCD2VRqsr-M-iVOws','haoweixin',1,1,NULL),(4036,'text','但不是水样的大便','20