5msl0Fk','Johnwoo',1,2,NULL),(4265,'text','好的，谢谢','2017-04-22 08:45:44',NULL,280,'oLx6Djtd3JNf_vPvVkWqB5msl0Fk','Johnwoo',1,1,NULL),(4266,'text','我想了解一下你们的服务/:,@-D','2017-04-22 08:46:10',NULL,280,'oLx6Djtd3JNf_vPvVkWqB5msl0Fk','Johnwoo',1,1,NULL),(4267,'text','你好，具体预约事宜请加微信obmcare 管家会进一步的详细介绍。','2017-04-22 08:56:06',NULL,280,'oLx6Djtd3JNf_vPvVkWqB5msl0Fk','Johnwoo',1,2,NULL),(4268,'text','好的，谢谢','2017-04-22 08:56:57',NULL,280,'oLx6Djtd3JNf_vPvVkWqB5msl0Fk','Johnwoo',1,1,NULL),(4269,'text','不客气','2017-04-22 08:57:11',NULL,280,'oLx6Djtd3JNf_vPvVkWqB5msl0Fk','Johnwoo',1,2,NULL),(4270,'text','你好！宝宝后半夜经常要吃奶哭闹，喂完奶之后半小时或一小时左右又要吃，但是再次喂的时候，他吸得不多，就含着奶头，人特别新鲜，不怎么睡觉，他这是什么原因啊？对了，他每次放屁特别痛苦的样子，整个人都扭来扭去的。','2017-04-23 06:55:08',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg',NULL,1,1,384),(4271,'text','你好！请问孩子目前多大？','2017-04-23 07:01:10',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,2,NULL),(4272,'text','29天','2017-04-23 07:01:58',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,1,NULL),(4273,'text','首先关于睡眠的问题。一般深睡眠集中在前半夜。后半夜进入浅睡眠和快速动眼期。的确会睡的不踏实。再来孩子和大人一样也会有自己的情绪。小月龄的宝宝的确需要家长们费心照料。','2017-04-23 07:05:45',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,2,NULL),(4274,'text','而来关于放屁的身体。这个月龄的宝宝会开始有肠胀气的烦恼。家人可通过飞机抱、排气操的方式，通过给予孩子腹部一定的压力，来帮助他排气。','2017-04-23 07:08:09',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,2,NULL),(4275,'text','排气操效果好吗？','2017-04-23 07:08:36',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,1,NULL),(4276,'text','肠胀气是这个月龄毕竟之路。看着有些痛苦，但是多数的孩子都要经过这么一个过程。等待胃肠道发育完善。父母能做到的辅助减轻他们的痛苦。另外，大哭大闹下马上喂奶容易增加气体的进入。因此，严重的哭闹下，先安抚，等待情绪稳定一些再喂奶。','2017-04-23 07:12:44',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,2,NULL),(4277,'text','哦，好的哦。我发现用了奶瓶喂奶后，宝宝乳头含的不对了，乳晕都不含了，请问这种情况应该怎么纠正比较好？','2017-04-23 07:14:44',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,1,NULL),(4278,'text','首先，确定要母乳喂养的家庭需要注意，小月龄宝宝，十分不推荐使用奶瓶喂奶。 如果家长是希望母乳喂养孩子的，那么请及时停止使用奶瓶。','2017-04-23 07:18:34',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,2,NULL),(4279,'text','含乳不正确的情况下不急着喂奶。一定要从新调整。确保正确含乳再喂。','2017-04-23 07:20:53',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,2,NULL),(4280,'text','纠正乳头混淆很难通过文字编辑来说明。','2017-04-23 07:22:17',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,2,NULL),(4281,'text','喂奶时，先让孩子长开的下嘴唇贴近乳晕边缘。 固定住后，等待嘴巴长大后。让整个乳晕一同被吸吮。这样的一个步骤。','2017-04-23 07:25:04',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,2,NULL),(4282,'text','好的哦！谢谢啦！','2017-04-23 07:32:16',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,1,NULL),(4283,'text','不用谢！[微笑]','2017-04-23 07:48:16',NULL,281,'oLx6DjvxgZ6VtFwpU1fhT2ZUBGFg','guxin',1,2,NULL),(4284,'text','老师，刚我儿子吃山药吃吐了。。。。','2017-04-23 13:14:31',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs',NULL,1,1,385),(4285,'text','吃了两口，然后把卖什么的全部吐出来了','2017-04-23 13:14:46',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs',NULL,1,1,385),(4286,'text','奶。。。。','2017-04-23 13:15:13',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs',NULL,1,1,385),(4287,'text','已经是糊状的了，应该不是噎着吧','2017-04-23 13:15:42',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs',NULL,1,1,385),(4288,'text','孩子多大','2017-04-23 13:16:39',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,2,NULL),(4289,'text','八个月','2017-04-23 13:38:54',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4290,'text','一周一宝宝晚上睡睡哭哭，闭眼拼命挣扎的哭，是什么原因呢？已经连续两三天这样了','2017-04-25 07:06:39',NULL,271,'oLx6Djm29jP7YbFmIvejkUUjpnSk','caoqin',1,1,NULL),(4291,'text','我现在怀孕三个月了有流血了，怎么办','2017-04-26 08:40:16',NULL,282,'oLx6DjnMY6W2LjeDu_Mfq7ngnnUw',NULL,1,1,386),(4292,'text','您好，宝宝七个多月了，吃辅食了，最近白天大便两三次，但是每次的量不多，就一个圆圆的 ，有时候能发现在用力大便，脸有点红，但是不痛苦的感觉，有时候没感觉用力就大出来了，正常吗','2017-04-26 09:15:23',NULL,220,'oLx6Dju5WB7yEqwt9ipPxL1URr9M',NULL,1,1,387),(4293,'text','就是每次的 量少','2017-04-26 09:15:35',NULL,220,'oLx6Dju5WB7yEqwt9ipPxL1URr9M',NULL,1,1,387),(4294,'text','你之前有过流产史吗','2017-04-26 09:43:33',NULL,282,'oLx6DjnMY6W2LjeDu_Mfq7ngnnUw','Johnwoo',1,2,NULL),(4295,'text','有','2017-04-26 09:43:49',NULL,282,'oLx6DjnMY6W2LjeDu_Mfq7ngnnUw','Johnwoo',1,1,NULL),(4296,'text','几次？','2017-04-26 09:44:06',NULL,282,'oLx6DjnMY6W2LjeDu_Mfq7ngnnUw','Johnwoo',1,2,NULL),(42