odan',1,1,NULL),(4418,'text','是不是我们哺乳方式不对？','2017-04-27 16:14:30',NULL,286,'oLx6DjnAebFnpfkQC7q2ctiZRyPw','zhaodan',1,1,NULL),(4419,'text','这个吃奶频率也是符合新生儿特点的；吸一边另一边会流也是正常的，因为喷乳反射是一起来的；吃奶后打嗝吐奶也是新生儿的特点之一，但是大量吐出蛋花状的奶……首先我们要关注的是宝宝吐完以后精神状态如何？是轻松了还是继续烦躁哭闹？宝宝的体重增长情况如何？等等一系列的问题关系到这是一个新生儿的正常状态充其量只是喂多了，还是病理性的（别怕，可能性很小）？每天/::)都有挤出来200毫升说明是有在使用吸奶器？很多哺乳妈妈因为堵奶 乳腺炎来找到我们的，常常是因为吸奶器使用不当。','2017-04-27 16:30:45',NULL,286,'oLx6DjnAebFnpfkQC7q2ctiZRyPw','zhaodan',1,2,NULL),(4420,'text','就你目前提供的信息，我能想到的就是这些，因为没有当面了解到更多。奶太多的妈妈更需要警惕堵奶和乳腺炎，因为随着宝宝一天天长大，很容易某个晚上宝宝睡得久了，妈妈就有奶结了。而宝宝不吃过度依赖吸奶器的话，妈妈最终也会不堪其扰，疲惫不堪。所以有问题尽量早点改善，如果需要老师上门服务可以联系我们管家预约，微信号：obmcare','2017-04-27 16:33:43',NULL,286,'oLx6DjnAebFnpfkQC7q2ctiZRyPw','zhaodan',1,2,NULL),(4421,'text','好的 谢谢，','2017-04-27 16:57:23',NULL,284,'oLx6DjtgeRGlFfG-hHxSrrqJuDUg','Johnwoo',1,1,NULL),(4422,'text','堵奶发烧了要怎么办','2017-04-27 16:59:27',NULL,283,'oLx6DjlS748V8-PQ25-sNhTwfERs',NULL,1,1,393),(4423,'text','冷敷，宝宝吸。如果宝宝不吸就手挤奶','2017-04-27 17:04:19',NULL,283,'oLx6DjlS748V8-PQ25-sNhTwfERs','daguanjia',1,2,NULL),(4424,'text','我们宝宝5个月，一直母乳喂养，大便也都正常','2017-04-27 17:20:35',NULL,287,'oLx6Djkb-F8xEG85ZqrvDwth4y_A',NULL,1,1,394),(4425,'text','你好','2017-04-27 17:21:02',NULL,287,'oLx6Djkb-F8xEG85ZqrvDwth4y_A','liyanhua',1,2,NULL),(4426,'text','这几天咳嗽，吃药，今天大便比较稠，粘粘的糊状','2017-04-27 17:21:17',NULL,287,'oLx6Djkb-F8xEG85ZqrvDwth4y_A','liyanhua',1,1,NULL),(4427,'text','是药物作用么？','2017-04-27 17:21:35',NULL,287,'oLx6Djkb-F8xEG85ZqrvDwth4y_A','liyanhua',1,1,NULL),(4428,'text','吃的什么药，有做检查吗','2017-04-27 17:21:54',NULL,287,'oLx6Djkb-F8xEG85ZqrvDwth4y_A','liyanhua',1,2,NULL),(4429,'text','前两天医院配的，吃了三天','2017-04-27 17:22:37',NULL,287,'oLx6Djkb-F8xEG85ZqrvDwth4y_A','liyanhua',1,1,NULL),(4430,'text','稍等，我去看下药名','2017-04-27 17:22:51',NULL,287,'oLx6Djkb-F8xEG85ZqrvDwth4y_A','liyanhua',1,1,NULL),(4431,'image','[图片消息]','2017-04-27 17:24:12','haeA8GsvPcatwGG81c8w69TtCAjlG-xevF6v6p3V8YCvsnilmA3AmUmjl8q5-7S1.jpg',287,'oLx6Djkb-F8xEG85ZqrvDwth4y_A','liyanhua',1,1,NULL),(4432,'image','[图片消息]','