。基本上，您家的孩子整体睡眠时间没有大问题。而且也有自己的睡眠规律。','2017-04-28 12:25:11',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,2,NULL),(4465,'text','请问孩子从多大开始由奶奶主要监护呢？','2017-04-28 12:26:45',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,2,NULL),(4466,'text','刚刚交给奶奶半个月','2017-04-28 12:31:43',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,1,NULL),(4467,'text','之前都是我自己带 我自己带的时候上午睡45分钟 下午睡三个小时','2017-04-28 12:32:08',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,1,NULL),(4468,'text','所以我担心她现在睡得太少了','2017-04-28 12:32:20',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,1,NULL),(4469,'text','小宝宝的适应能力较成人肯定差很多。睡眠涉及到一个人的先天敏感度和体能消耗等等多个方面。所以从这两个角度下手。满足安全感和白天充分的玩耍。','2017-04-28 12:38:21',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,2,NULL),(4470,'text','嗯嗯 那怎么满足她的安全感呢','2017-04-28 12:38:52',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,1,NULL),(4471,'text','首先保证目前的生活方式和环境打造和原先的尽量接近。妈妈需要和奶奶交流一下。其实在更换带养人之前应该有半个月或更多的时间来磨合。其次睡觉的时候可以用软枕头等物品稍微抵住孩子的双腿。或是放入小床时，让孩子睡在小床下半部，脚和头分别接触到床尾和床边延。','2017-04-28 12:43:24',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,2,NULL),(4472,'text','这样做的目的是让他感觉到被包裹。他喜欢被怀抱入睡，也是对子宫环境的回忆。','2017-04-28 12:44:44',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,2,NULL),(4473,'text','其次，孩子大了对精神层面的需求也变得越来越大。充分的玩耍，愉快的情绪才能让他满足。育儿应该从满足吃喝睡这样的存活需求开始像精神需求方面发展。 希望能帮到妈妈！[微笑]','2017-04-28 12:46:49',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,2,NULL),(4474,'text','嗯嗯 好的 谢谢','2017-04-28 12:54:14',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,1,NULL),(4475,'text','然后我还在问下 宝宝白天也不肯吃奶，一整天就吃100ml','2017-04-28 12:54:42',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,1,NULL),(4476,'text','怎么办呀','2017-04-28 12:54:46',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,1,NULL),(4477,'text','孩子现在是母乳还是奶粉呢？','2017-04-28 12:56:33',NULL,288,'oLx6DjmjhA3rSvbV8v97gV1FmQM0','guxin',1,2,NULL),(4478,'text','现在每天8:00母乳，然后10:00吃米粉，13:00吃100ML奶粉，15:00吃米粉，17:30喂母乳，19:00母乳，3:00母乳，5:30母乳。这样行不行？然后纯母乳的时候不吃夜奶了，一觉能睡到早上六七点，现在不知道为什么又开始吃夜奶？','2017-04-28 12:56:42',NULL,288,'oLx6DjmjhA3rSvbV8v