,'前三个月应注意那些问题','2017-05-02 02:12:29',NULL,292,'oLx6Djm76IRYKerr6qZVyMhQF2Xc',NULL,1,1,401),(4548,'text','你好！夜间23点后无人值班。','2017-05-02 09:12:09',NULL,292,'oLx6Djm76IRYKerr6qZVyMhQF2Xc','Johnwoo',1,2,NULL),(4549,'text','现在我来回答你的问题。','2017-05-02 09:12:25',NULL,292,'oLx6Djm76IRYKerr6qZVyMhQF2Xc','Johnwoo',1,2,NULL),(4550,'text','在孕早期如果没有特别的病理性问题。那么我们应该注意营养均衡摄入问题，特别是有孕吐的妈妈，更应该注意选择食材摄入，少量多餐，保证胎儿的营养需求。在孕早期体重控制也特别重要，BMI超标的妈妈应该尽量做的不增长或极少增长。因为在孕中晚期胎儿的需求会不断增加。如果前期的营养没有做到均衡补充，后期可能会出现一系列营养素缺乏的问题，造成一些病理性问题。','2017-05-02 09:19:49',NULL,292,'oLx6Djm76IRYKerr6qZVyMhQF2Xc','Johnwoo',1,2,NULL),(4551,'text','在营养素的补充上 尽量选择食补，因为综合营养素的补充可能会导致某些指标补充过量，从而导致某些营养素或微量元素不吸收','2017-05-02 09:21:51',NULL,292,'oLx6Djm76IRYKerr6qZVyMhQF2Xc','Johnwoo',1,2,NULL),(4552,'text','如果有其他病理性问题，那么就要听你的临床医嘱 同时也可以找到专业的临床营养师 帮助完成孕产阶段的体重控制及平衡营养摄入','2017-05-02 09:25:36',NULL,292,'oLx6Djm76IRYKerr6qZVyMhQF2Xc','Johnwoo',1,2,NULL),(4555,'text','老师，不能答疑吗','2017-05-02 20:23:52',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs',NULL,1,1,402),(4556,'text','你好','2017-05-02 20:24:29',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,2,NULL),(4557,'text','有什么问题你直接问。','2017-05-02 20:24:51',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,2,NULL),(4558,'image','[图片消息]','2017-05-02 20:26:01','FTl77ZClOrDYCzXUQ0A2PBfzFCEpyjJrSo8Kjnysn2XQ01RGMrOmJ8C53YioI54i.jpg',199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4559,'image','[图片消息]','2017-05-02 20:26:03','pkxGpfzV1fpHpjqe06soEfIr2J7pYGrI0VrLeY1oClltR4g_08WR5hnh5IYlLumk.jpg',199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4560,'text','能帮我看看宝宝这个是什么吗？','2017-05-02 20:26:13',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4561,'text','摸上去皮肤有毛糙的感觉吗？','2017-05-02 20:26:53',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,2,NULL),(4562,'text','有点凹凸感','2017-05-02 20:27:24',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4563,'text','是颗粒还是风团','2017-05-02 20:28:08',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,2,NULL),(4564,'text','应该是颗粒','2017