o',1,2,NULL),(4600,'text','老师，如果断奶的话，母婴分离是不是比较残忍','2017-05-03 15:37:34',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4601,'text','医生说过段时间再查','2017-05-03 15:37:49',NULL,293,'oLx6Djm76IRYKerr6qZVyMhQF2Xc','haoweixin',1,1,NULL),(4602,'text','我们建议自然离乳。就算要提前离乳也应该有方法。不是强硬分离','2017-05-03 15:38:36',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,2,NULL),(4603,'text','阴道瘙痒不适会比较难忍受，最好今早就医，那你没跟医生说你痒不舒服吗？医生没给你什么建议吗？','2017-05-03 15:38:40',NULL,293,'oLx6Djm76IRYKerr6qZVyMhQF2Xc','haoweixin',1,2,NULL),(4604,'text','我们宝宝现在是只有奶睡跟夜奶一两次了','2017-05-03 15:38:51',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4605,'text','所以我在想不要分离行不行','2017-05-03 15:38:57',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4606,'text','你看的是妇科医生，还是你的产科医生','2017-05-03 15:39:04',NULL,293,'oLx6Djm76IRYKerr6qZVyMhQF2Xc','haoweixin',1,2,NULL),(4607,'text','这样宝宝会出现极度的安全缺失','2017-05-03 15:39:08',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,2,NULL),(4608,'text','是的，从出生以来都是跟我睡的，一个晚上都么有分开过、','2017-05-03 15:39:23',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4609,'text','现在八个多月','2017-05-03 15:39:29',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4610,'text','宝宝现在多大？','2017-05-03 15:39:30',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,2,NULL),(4611,'text','看的是妇产科医生','2017-05-03 15:39:50',NULL,293,'oLx6Djm76IRYKerr6qZVyMhQF2Xc','haoweixin',1,1,NULL),(4612,'text','为什么现在就准备离乳呢？','2017-05-03 15:40:12',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,2,NULL),(4613,'text','接下来的职业规划也是，然后职场装修，装完就要搬进去，到时候奶也不好','2017-05-03 15:41:05',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4614,'text','宝宝是16.8.19号生的','2017-05-03 15:41:14',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,1,NULL),(4615,'text','县城医院医疗水平有限','2017-05-03 15:41:45',NULL,293,'oLx6Djm76IRYKerr6qZVyMhQF2Xc','haoweixin',1,1,NULL),(4616,'text','奶没有不好这个说法呢','2017-05-03 15:42:04',NULL,199,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','Johnwoo',1,2,NULL),(4617,'text','和医师说了痒不