力','2017-05-17 07:29:03',NULL,309,'oLx6DjquJKwlNiTNriA_0mwKJtPo','haoweixin',1,2,NULL),(4997,'text','还有可能是因为在你怀孕前体态的不正确导致脊椎的侧弯，那就有可能会有侧睡的偏爱，再加上怀孕身体负担大起来，没有很好的腹肌力量，靠骨盆的力量会导致骨盆前倾也会加重腰部的不适，所以有可能可以找专业的孕产教练帮助调节姿势和做一些锻炼','2017-05-17 07:32:24',NULL,309,'oLx6DjquJKwlNiTNriA_0mwKJtPo','haoweixin',1,2,NULL),(4998,'text','最好还是能左侧卧','2017-05-17 07:32:41',NULL,309,'oLx6DjquJKwlNiTNriA_0mwKJtPo','haoweixin',1,2,NULL),(4999,'text','咨询了商品-<a href=\"http://wp.theobmc.com/item?itemId=43\">Baby Care</a>','2017-05-17 15:04:18',NULL,310,'oLx6Djh5dR7CWoLMbPlAlcQuJuLw',NULL,1,1,426),(5000,'text','你好','2017-05-17 15:12:13',NULL,310,'oLx6Djh5dR7CWoLMbPlAlcQuJuLw','Johnwoo',1,2,NULL),(5001,'text','有什么可以帮你','2017-05-17 15:12:22',NULL,310,'oLx6Djh5dR7CWoLMbPlAlcQuJuLw','Johnwoo',1,2,NULL),(5002,'text','你好，想问一下宝宝昨天刚满月从月子会所回到家，闹腾了一晚上，今天白天也没肯好好睡觉，有啥办法吗','2017-05-17 16:33:35',NULL,277,'oLx6DjgD401szKkurD7-IcTP-Jn4',NULL,1,1,427),(5003,'text','我女儿感冒咳嗽我能不能吃榴莲','2017-05-17 20:24:37',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,1,428),(5004,'text','这两者没有必然的联系','2017-05-17 20:25:21',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,2,NULL),(5005,'text','除非孩子有过敏反应','2017-05-17 20:25:39',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,2,NULL),(5006,'text',' 好的谢谢','2017-05-17 20:25:53',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,1,NULL),(5007,'text','多喂奶多抱他，因为环境改变他不适应没有安全感，所以多喂奶和多抱他来安抚','2017-05-17 20:27:50',NULL,277,'oLx6DjgD401szKkurD7-IcTP-Jn4','haoweixin',1,2,NULL),(5008,'text','这两天不管白天晚上没次只肯吃一边，这倒确实增加了喂奶次数。宝宝好聪明','2017-05-18 09:01:15',NULL,277,'oLx6DjgD401szKkurD7-IcTP-Jn4','haoweixin',1,1,NULL),(5009,'text','可是这样每次只吃一半，没关系吗？','2017-05-18 09:01:37',NULL,277,'oLx6DjgD401szKkurD7-IcTP-Jn4','haoweixin',1,1,NULL),(5010,'text','没关系的，吃完一边如果你另一边涨的话你就把没吃的这边稍微挤掉一点舒服了不涨了就可以不要完全排空，下次吃奶的时候就换这边吃就好了','2017-05-18 09:04:29',NULL,277,'oLx6DjgD401szKkurD7-IcTP-Jn4','haoweixin',1,2,NULL),(5011,'text','不要紧的，只要不涨的引起堵奶就没事','2017-05-18 09:04:52',NULL,277,'oLx6DjgD401szKkurD7-IcTP-Jn4','haoweixin',1,2,NULL),(5012,'text','好的，谢谢','2017-05-18 09:09:33',NULL,277,'oLx6DjgD401szKkurD7-IcTP-Jn4','haoweixin',1,1,NULL),(5013,'text','这样频繁的挤或者吸奶器吸，对乳房不好吧？','2017-05-18 09:11:14',NULL,277,'oLx6DjgD401szKkurD7-IcTP-Jn4','haoweixin',1,1,NULL),(5014,'text','所以说你只要不涨就不用挤，觉得涨了就排掉一点舒服了就好，不要排空，但也不要等到涨的都疼了再挤，那样的情况下使用吸奶器会加剧水肿而且也不怎么能吸的出来','2017-05-18 09:13:08',NULL,277,'oLx6DjgD401szKkurD7-IcTP-Jn4','haoweixin',1,2,NULL),(5015,'text','哦，谢谢','2017-05-18 09:22:13',NULL,277,'oLx6DjgD401szKkurD7-IcTP-Jn4','haoweixin',1,1,NULL),(5016,'text','您好！因个人原因给宝宝断奶一个月了，还能有办法再追回来吗？','2017-05-18 12:48:49',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8',NULL,1,1,429),(5017,'text','当初是因为什么原因断奶的呢','2017-05-18 12:49:29',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5018,'text','是母乳少？还是有病理性问题','2017-05-18 12:50:18',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5019,'text','当时是因为我闻了对门的油漆味，怕对孩子有影响，就断了','2017-05-18 12:50:31',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5020,'text','这个影响不大啊！主要你配合我们应该没有问题。宝宝现在每天多少奶粉？','2017-05-18 12:51:50',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5021,'text','600-700','2017-05-18 12:52:10',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5022,'text','现在宝宝多大？','2017-05-18 12:52:26',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5023,'text','现在是3个半月，当时断的时候是2个半月','2017-05-18 12:52:55',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5024,'text','嗯！你在那个城市呢？','2017-05-18 12:53:31',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5025,'text','石家庄','2017-05-18 12:53:37',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5026,'text','当时断奶的时候已经开始添加奶粉了，因为母乳有些不足了','2017-05-18 12:54:06',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5027,'text','哦！目前我们只有杭州和苏州。没有办法一对一帮你。我可以给你一些建议，你试试看。','2017-05-18 12:54:50',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5028,'text','后来怕对孩子有影响，我就用吸奶器吸出来，后来越吸越少，今天都吸不出来了','2017-05-18 12:55:30',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5029,'text','有天我让孩子吃母乳，她吃了两口，就恶心','2017-05-18 12:56:22',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5030,'text','首先每天一点点的减少奶粉量，另外尽量多喂，每天保持8-12次。也可以跟宝宝做肌肤接触，让宝宝趴在你胸上。双方都裸露上身。这样的刺激多泌乳素分泌有很大的帮助。另外每天保持2000ml的水分摄入','2017-05-18 12:57:57',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5031,'text','那我这么久没让宝宝吃母乳，母乳没有问题吧？','2017-05-18 12:59:37',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5032,'text','母乳都是妈妈身体分泌的，能有什么问题呢？不用担心','2017-05-18 13:00:25',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5033,'text','我婆婆说我现在如果有奶，都是陈旧的奶，得把这些挤干净','2017-05-18 13:01:29',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5034,'text','道听途说。让她拿出科学依据','2017-05-18 13:02:07',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5035,'text','那像我前阵子闻了油漆味，有必要断奶吗？','2017-05-18 13:03:19',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5036,'text','没有必要','2017-05-18 13:03:41',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5037,'text','老师，一岁前的宝宝不能吃盐，刚买了面条发现所有面条成分里都有盐啊。那面条能吃嘛','2017-05-18 13:03:52',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0',NULL,1,1,430),(5038,'text','那最好别吃了，因为盐和多的钠对宝宝的肾脏负担比较重，代谢不好','2017-05-18 13:05:07',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,2,NULL),(5039,'text','那是我做错了呗','2017-05-18 13:05:15',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5040,'text','我从网上百度查的，说是最好断奶','2017-05-18 13:05:35',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5041,'text','这样，那宝宝辅食都应该吃什么啊/::</::<','2017-05-18 13:05:48',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,1,NULL),(5042,'text','可以用儿童意面，只要孩子已经会吃这种面就可以','2017-05-18 13:06:16',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,2,NULL),(5043,'text','几个月大','2017-05-18 13:06:24',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,2,NULL),(5044,'text','9个月。','2017-05-18 13:06:37',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,1,NULL),(5045,'text','百度的信息怎么会可靠。谁会对自己的言语负责呢？','2017-05-18 13:06:40',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5046,'text','意面？','2017-05-18 13:06:53',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,1,NULL),(5047,'text','我买的儿童鸡蛋面','2017-05-18 13:07:01',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,1,NULL),(5048,'text','儿童意大利面吗老师？','2017-05-18 13:07:17',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,1,NULL),(5049,'text','我们每天吸入的pm2.5 比你闻的油漆味厉害多了','2017-05-18 13:07:31',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5050,'text','辅食只是不让你给孩子加调味料，正常的面，米都可以吃','2017-05-18 13:07:34',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,2,NULL),(5051,'text','哦哦哦','2017-05-18 13:07:51',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,1,NULL),(5052,'text','好吧。谢谢老师','2017-05-18 13:07:59',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,1,NULL),(5053,'text','儿童意面你也可以看一下，我记得是没有添加的，而且有各种形态，因为它比起龙须面和挂面要硬一点所以也要看你孩子的咀嚼和吞咽能力到了没有','2017-05-18 13:09:45',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,2,NULL),(5054,'text','我真是自己害了自己，早点咨询你们就好了','2017-05-18 13:11:00',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5055,'text','没事，现在也还来得及。','2017-05-18 13:11:29',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5056,'text','可是宝宝现在不吃我的奶','2017-05-18 13:11:46',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5057,'text','一吃就恶心','2017-05-18 13:11:58',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5058,'text','如果想给孩子买面就买正常的龙须面或者细一点的挂面不就好了吗，不需要什么添加鸡蛋什么的就有可能会添加盐分，所以买面的时候休息一下，再说了谁家还没有个鸡蛋呢，放着新鲜的不吃干嘛非要吃添加的呢','2017-05-18 13:12:16',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,2,NULL),(5059,'text','慢慢磨合，多做肌肤接触','2017-05-18 13:12:25',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5060,'text','那我最近胃病又犯了，是不是不能吃药啊','2017-05-18 13:13:00',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5061,'text','那我这个先给自己吃好了/::D/::D/::D','2017-05-18 13:16:37',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,1,NULL),(5062,'text','再去买','2017-05-18 13:16:40',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,1,NULL),(5063,'text','可以的','2017-05-18 13:16:51',NULL,194,'oLx6DjpDpO8aXAuSkTMTyAtJpqK0','haoweixin',1,2,NULL),(5064,'text','母乳期有安全用药的','2017-05-18 13:18:39',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5065,'text','你跟医生说让她开L1的药','2017-05-18 13:19:00',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,2,NULL),(5066,'text','医生都知道吗？','2017-05-18 13:19:13',NULL,311,'oLx6DjtxpieKdzYaVDaXLzSwn_c8','Johnwoo',1,1,NULL),(5067,'text','你好现在断奶会不会太热','2017-05-18 23:02:37',NULL,159,'oLx6DjgK5E3u9iB7J3KNk2BlU6Ao',NULL,1,1,431),(5068,'text','我女儿不是咳嗽嘛。能不能给她吃冰糖炖梨','2017-05-19 06:55:59',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,1,432),(5069,'text','八个月','2017-05-19 06:56:04',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,1,432),(5070,'text','主要是冰糖，能不能吃','2017-05-19 06:56:17',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,1,432),(5071,'text','不能吃','2017-05-19 09:10:50',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,2,NULL),(5072,'text',' 吃了怎么办','2017-05-19 09:11:18',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,1,NULL),(5073,'text','影响宝宝肠道和代谢','2017-05-19 09:11:57',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,2,NULL),(5074,'text','好的谢谢。我婆婆就是不听。已经给他吃过了。 烦死了','2017-05-19 09:12:37',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,1,NULL),(5075,'text','这些老偏方为什么会用到孩子身上','2017-05-19 09:12:53',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,2,NULL),(5076,'text','本身就没有什么用，大人吃了无所谓就当吃饭。','2017-05-19 09:13:31',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,2,NULL),(5077,'text','便便比平常多可能也是吃了冰糖咯','2017-05-19 09:14:15',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,1,NULL),(5078,'text','吃了就算了，以后别吃就好了','2017-05-19 09:45:03',NULL,135,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','Johnwoo',1,2,NULL),(5079,'text','请问三个月宝宝，最近换尿片发现宝宝屁眼周围有些小白点，类似粉刺一样的东西，请问是什么原因','2017-05-19 09:47:49',NULL,237,'oLx6Djl_dxHvw1LlijCyVm1XG4bw',NULL,1,1,433),(50