,220,'oLx6Dju5WB7yEqwt9ipPxL1URr9M','haoweixin',1,2,NULL),(5148,'text','太多重口味宝宝的肾脏负担太重','2017-05-23 09:09:16',NULL,220,'oLx6Dju5WB7yEqwt9ipPxL1URr9M','haoweixin',1,2,NULL),(5149,'text','好的，谢谢','2017-05-23 09:10:01',NULL,220,'oLx6Dju5WB7yEqwt9ipPxL1URr9M','haoweixin',1,1,NULL),(5150,'text','一直母乳，现在上班了，白天给吃奶粉晚上吃母乳，宝宝不接受奶粉怎么办？一天都不吃也不喝水','2017-05-23 12:47:03',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8',NULL,1,1,444),(5151,'text','考虑背奶吗？','2017-05-23 13:07:46',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5152,'text','嗯，想白天给他吃奶粉，晚上给吃母乳','2017-05-23 14:12:16',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5153,'text','确实任何奶粉的口感比不上“原装”的母乳，只能说你家宝宝很聪明/:,@P很有品味～换做是你，一直是吃米其林三星餐厅的，突然之间告诉你白天只能吃沙县小吃，你肯定也一时间不能接受嘛……慢慢来，可以白天先喝挤出来的奶，逐渐过渡。','2017-05-23 14:31:09',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5154,'text','好','2017-05-23 14:31:43',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5155,'text','小宝宝现在快七个月了。白天一天不吃等我回去。这样我怕他饿坏了','2017-05-23 14:32:19',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5156,'text','辅食呢','2017-05-23 14:33:20',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5157,'text','米粉也不好好吃','2017-05-23 14:33:36',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5158,'text','小家伙可能因为吃奶这件事有小情绪了，再加上越是着急想让她吃，她越是抵抗～而且也不能光吃米粉啊，如果影响到辅食种类的添加就更麻烦了','2017-05-23 14:37:23',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5159,'text','那现在该怎么办','2017-05-23 14:38:13',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5160,'text','刚才有说了提议啊','2017-05-23 14:38:55',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5161,'text','宝宝饿几天能饿瘦吗？会不会生病','2017-05-23 16:12:22',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5162,'text','如果每天尿很少（一整天下来5个比较饱满的尿不湿都没有），颜色很黄，甚至哭的时候都很少有眼泪，那要引起警惕，谨防脱水。毕竟一岁以内还是以奶为主的，长期下来只靠早晚亲喂这点奶肯定是不够的','2017-05-23 17:11:20',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5163,'text','对，尿特别黄。而且尿少','2017-05-23 17:12:04',NULL