04:38',NULL,300,'oLx6DjlS748V8-PQ25-sNhTwfERs','Johnwoo',1,2,NULL),(5184,'text','请问生完孩子以后得几个月内是不能碰没有煮开的水吗？','2017-05-24 20:55:26',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM',NULL,1,1,447),(5185,'text','你是说饮用水吗？','2017-05-24 20:56:14',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,2,NULL),(5186,'text','不是饮用   是洗漱洗衣服洗菜之类的','2017-05-24 20:56:48',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,1,NULL),(5187,'text','老家长辈说  生完宝宝四个月不能碰没有煮开的水  有什么依据么？','2017-05-24 20:57:43',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,1,NULL),(5188,'text','毫无科学依据','2017-05-24 20:58:04',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,2,NULL),(5189,'text','首先妈妈产后，在产褥期会排出大量的产褥汗，这个决定妈妈必须保持卫生，勤洗澡。','2017-05-24 20:59:14',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,2,NULL),(5190,'text','烧开的水和没有烧开的水区别仅仅是水里面的细菌以及矿物质含量的区别。','2017-05-24 21:00:59',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,2,NULL),(5191,'text','不知道我这样说，有解决你的困惑吗？','2017-05-24 21:01:38',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,2,NULL),(5192,'text','凉的水和热的水呢？','2017-05-24 21:01:50',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,1,NULL),(5193,'text','说碰了凉的水 以后骨头疼什么的 好担心','2017-05-24 21:02:12',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,1,NULL),(5194,'text','凉水也没有问题，只要你的体感没有觉得不舒服就好。','2017-05-24 21:04:09',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,2,NULL),(5195,'text','嗯嗯  明白了','2017-05-24 21:06:21',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,1,NULL),(5196,'text','非常感谢/:rose','2017-05-24 21:06:28',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,1,NULL),(5197,'text','不客气','2017-05-24 21:06:35',NULL,318,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','daguanjia',1,2,NULL),(5198,'text','产后康复','2017-05-24 23:10:16',NULL,319,'oLx6Djn6B6E4x4durTeWyCBfFbJ8',NULL,1,1,448),(5199,'text','怎么做','2017-05-24 23:10:27',NULL,319,'oLx6Djn6B6E4x4durTeWyCBfFbJ8',NULL,1,1,448),(5200,'text','你好！产后康复最好是在产后第一时间就开始。在产褥期主要应该集中康复盆底肌以及腹直肌分离','2017-05-24 23:12:00',NULL,319,'oLx6Djn6B6E4x4durTeWyCBfFbJ8','Johnwoo',1,2,NULL),(5201,'text','盆底肌的具体康复主要是集中呼吸方式，掌握好发力。适当的力度激活盆底肌，具体的方法应该找到专业孕产康复顾问起做。如果需要有效的减脂和塑型，在饮食上也应该注意。','2017-05-24 23:15:32',NULL,319,'oLx6Djn6B6E4x4durTeWyCBfFbJ8','Johnwoo',1,2,NULL),(5202,'text','如果在产褥期应该避免浓汤高脂饮食摄入','2017-05-24 23:16:02',NULL,319,'oLx6Djn6B6E4x4durTeWyCBfFbJ8','Johnwoo',1,2,NULL),(5203,'text','同时哺乳期的能量摄入应该多加500卡的能量','2017-05-24 23:19:03',NULL,319,'oLx6Djn6B6E4x4durTeWyCBfFbJ8','Johnwoo',1,2,NULL),(5204,'text','所有的康复线上我无法给到你具体的方法，因为每个人的体型以及分娩方式不一样，方法也不一样。如果你有兴趣也可以添加微信obmcare 咨询管家更多的细节。','2017-05-24 23:21:42',NULL,319,'oLx6Djn6B6E4x4durTeWyCBfFbJ8','Johnwoo',1,2,NULL),(5205,'text','老师，宝宝吃鱼的话，是不是只要是深海鱼就可以了','2017-05-26 10:45:38',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,1,NULL),(5206,'text','我们现在在吃肉贴鱼，鲳鱼，现在不是禁渔期么，出海都找不到这么新鲜的鱼了，所以想问下小黄鱼，鸦片鱼头这种行不行的','2017-05-26 10:46:15',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs',NULL,1,1,449),(5207,'text','或者马鲛鱼','2017-05-26 10:46:18',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs',NULL,1,1,449),(5208,'text','都可以的，吃了以后观察宝宝有没有过敏症状就行','2017-05-26 10:47:12',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,2,NULL),(5209,'text','吃鱼一周吃两三次就行','2017-05-26 10:47:27',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,2,NULL),(5210,'text','好的，已经一周没有吃红肉了，有关系么','2017-05-26 10:47:59',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,1,NULL),(5211,'text','没有关系的，宝宝多大','2017-05-26 10:48:15',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,2,NULL),(5212,'text','九个月多','2017-05-26 10:48:56',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,1,NULL),(5213,'text','恩 一岁以内奶还是主食的，辅食不用在意很多','2017-05-26 10:49:49',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,2,NULL),(5214,'text','好滴，谢谢老师','2017-05-26 10:54:18',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,1,NULL),(5215,'text','小宝宝太会吃啦','2017-05-26 10:54:24',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,1,NULL),(5216,'text','嘴巴没停下来啊','2017-05-26 10:54:27',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,1,NULL),(5217,'text','好事啊，好多妈妈都焦虑宝宝不吃呢','2017-05-26 10:55:01',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,2,NULL),(5218,'text','那我家宝宝没这个困扰，超能吃的','2017-05-26 10:57:09',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,1,NULL),(5219,'text','看到别人吃，眼睛都移不开了','2017-05-26 10:57:16',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,1,NULL),(5220,'text','看到奶瓶没给他喝，分分钟就哭了','2017-05-26 10:57:26',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,1,NULL),(5221,'text','哈哈','2017-05-26 10:57:33',NULL,315,'oLx6DjmGsAG8TUWISPnqHUKK_DTs','liyanhua',1,2,NULL),(5222,'text','您好，给她吃了米粉，还有香蕉，然后拉的粑粑不正常了','2017-05-26 12:31:44',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88',NULL,1,1,450),(5224,'text','怎么不正常呢？','2017-05-26 12:32:30',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,2,NULL),(5225,'text','有那些褐色的东西','2017-05-26 12:33:00',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,1,NULL),(5226,'text','米粉是自己做的还是买来的','2017-05-26 12:33:09',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,2,NULL),(5227,'text','图片您看到么？','2017-05-26 12:33:13',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,1,NULL),(5228,'text','买的','2017-05-26 12:33:16',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,1,NULL),(5229,'text','能看到','2017-05-26 12:33:24',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,2,NULL),(5230,'text','宝宝添加辅食后，大便会有一些变化，包括有可能会出现便秘。这些都是正常的','2017-05-26 12:34:23',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,2,NULL),(5231,'text','/::~/::~','2017-05-26 12:34:25',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,1,NULL),(5232,'text','都不知道是些什么东西','2017-05-26 12:34:54',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,1,NULL),(5233,'text','大便只要不是白色或者黑色 基本就不会有太大问题。','2017-05-26 12:35:10',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,2,NULL),(5234,'text','宝宝精神状态怎么样？','2017-05-26 12:35:19',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,2,NULL),(5235,'text','正常的','2017-05-26 12:35:49',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,1,NULL),(5236,'text','那就不要太担心','2017-05-26 12:37:01',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,2,NULL),(5237,'text','看着好像寄生虫/:,@P','2017-05-26 12:37:01',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,1,NULL),(5238,'text','米粉尽量自己做。熬粥后用搅拌机打碎就好','2017-05-26 12:37:45',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,2,NULL),(5239,'text','原来自己做了她不吃，就懒得做了，买来的也不爱吃，只是图方便','2017-05-26 12:39:23',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,1,NULL),(5240,'text','买来的出门用用就好','2017-05-26 12:39:59',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,2,NULL),(5241,'text','好的，谢谢','2017-05-26 12:40:53',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,1,NULL),(5242,'text','不客气','2017-05-26 12:41:09',NULL,240,'oLx6Djnh3eMa0lGDLds2uFru-Q88','Johnwoo',1,2,NULL),(5243,'text','宝宝睡眠问题','2017-05-26 20:44:08',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM',NULL,1,1,451),(5244,'text','你好','2017-05-26 20:44:30',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5245,'text','有什么可以帮你？','2017-05-26 20:44:43',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5246,'text','你好。想咨询下宝宝的睡眠问题。宝宝45天了，满月后睡觉就成了大问题。白天要抱睡或者奶睡，晚上稍微好点，大部分时间可以自主入睡，有什么办法可以解决？','2017-05-26 20:46:08',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,1,NULL),(5247,'text','每个宝宝都不一样，这么小的宝宝抱睡或者奶睡都很正常啊！你是不想奶睡或者抱睡吗。','2017-05-26 20:48:00',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5248,'text','我没有意见。我是怕以后纠正不过来。','2017-05-26 20:52:39',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,1,NULL),(5249,'text','而且今天特别不正常，一直要吃。一般一顿隔三小时吃，今天吃完一下子隔两小时要吃，一下子隔一个小时就要吃。有什么原因吗？','2017-05-26 20:53:47',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,1,NULL),(5250,'text','宝宝还小，在很长一段时间对妈妈依赖很大。应该进入猛涨期了。','2017-05-26 20:54:16',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5251,'text','懂了。那她要吃就给她吃，不管时间的限制是吗？','2017-05-26 20:55:07',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,1,NULL),(5252,'text','是的，按需喂养','2017-05-26 20:55:20',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5253,'text','另外，吃的时候有的时候一直动，还吐奶头哭，一直放屁，这是胀气还是肠绞痛？','2017-05-26 20:56:24',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,1,NULL),(5254,'text','肠胀气','2017-05-26 20:57:28',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5255,'text','平时可以飞机抱','2017-05-26 20:57:49',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5256,'text','除了飞机抱还有其他方法吗？','2017-05-26 21:07:19',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,1,NULL),(5257,'text','一边飞机抱一边下蹲','2017-05-26 21:07:58',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5258,'text','另外还有个问题，我看一般都介绍45天宝宝要睡14到17个小时，我家一般15个小时左右，但是有时候达不到最少的14小时。这样对她的智力发育和身体发育有影响吗？','2017-05-26 21:08:55',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,1,NULL),(5259,'text','好的，我试试飞机抱下蹲','2017-05-26 21:09:04',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,1,NULL),(5260,'text','科学育儿，而不是照本宣科。不用去计较时间。就像很多书本推荐每三小时喂一次奶一样，这个计算是按平均数据计算的。并不是绝对的准确。所以我推荐的是按需喂养。','2017-05-26 21:11:23',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5261,'text','我可能太教条了/::~','2017-05-26 21:12:38',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,1,NULL),(5262,'text','没事，放轻松点。不需要太过焦虑。','2017-05-26 21:13:38',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5263,'text','我感觉我挺焦虑的，这样的心情会不会影响宝宝？','2017-05-26 21:14:03',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,1,NULL),(5264,'text','确实会有一定的影响。所以妈妈需要找到一个合适的对话地方。让自己轻松些。也可以让先生回来给按摩按摩','2017-05-26 21:15:37',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5265,'text','好滴。谢谢啦/::D很有帮助','2017-05-26 21:15:58',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,1,NULL),(5266,'text','?','2017-05-26 21:19:06',NULL,320,'oLx6Djr9_r3bz1XO4VHZKZwjErkM','daguanjia',1,2,NULL),(5267,'text','一般城市哪种机构会有专业的产后修复，因为不在杭州也不在南京','2017-05-27 09:11:46',NULL,319,'oLx6Djn6B6E4x4durTeWyCBfFbJ8',NULL,1,1,452),(5268,'text','你在那个城市呢？','2017-05-27 09:12:22',NULL,319,'oLx6Djn6B6E4x4durTeWyCBfFbJ8','Johnwoo',1,2,NULL),(5269,'text','温州','2017-05-27 09:12:40',N