2,NULL),(5479,'text','前面已经说了当务之急是多了解孩子哭背后的需求，不是一味的认为他没吃饱','2017-06-01 22:16:11',NULL,325,'oLx6DjnbqCMDLU04mwzVGZ2InMgk','liyanhua',1,2,NULL),(5480,'text','嗯','2017-06-01 22:16:25',NULL,325,'oLx6DjnbqCMDLU04mwzVGZ2InMgk','liyanhua',1,1,NULL),(5481,'text','好的','2017-06-01 22:16:29',NULL,325,'oLx6DjnbqCMDLU04mwzVGZ2InMgk','liyanhua',1,1,NULL),(5482,'text','你好，我想问一下孕28周+4晚上睡觉觉得胸闷气短怎么回事，白天就没事','2017-06-02 08:39:06',NULL,284,'oLx6DjtgeRGlFfG-hHxSrrqJuDUg',NULL,1,1,459),(5483,'text','孕中晚期随着宝宝一天天长大，各个气脏会慢慢收到一定的压迫。妈妈会感觉不舒服。可以调整一下睡觉姿势。','2017-06-02 08:40:57',NULL,284,'oLx6DjtgeRGlFfG-hHxSrrqJuDUg','Johnwoo',1,2,NULL),(5484,'text','嗯嗯，好的，谢谢，我可以把枕头垫高睡吗','2017-06-02 08:41:38',NULL,284,'oLx6DjtgeRGlFfG-hHxSrrqJuDUg','Johnwoo',1,1,NULL),(5485,'text','只要你觉得舒服就可以','2017-06-02 08:42:01',NULL,284,'oLx6DjtgeRGlFfG-hHxSrrqJuDUg','Johnwoo',1,2,NULL),(5486,'text','好的，谢谢，没事就好','2017-06-02 08:42:11',NULL,284,'oLx6DjtgeRGlFfG-hHxSrrqJuDUg','Johnwoo',1,1,NULL),(5487,'text','对了，还有现在我吃东西还会吐是怎么回事','2017-06-02 08:42:41',NULL,284,'oLx6DjtgeRGlFfG-hHxSrrqJuDUg','Johnwoo',1,1,NULL),(5488,'text','怎么才能好呢','2017-06-02 08:42:58',NULL,284,'oLx6DjtgeRGlFfG-hHxSrrqJuDUg','Johnwoo',1,1,NULL),(5489,'text','孕吐是正常反应，尽量少吃多餐。适当地多一些维生素B族的摄入，有缓解作用','2017-06-02 08:44:19',NULL,284,'oLx6DjtgeRGlFfG-hHxSrrqJuDUg','Johnwoo',1,2,NULL),(5490,'text','好的，谢谢','2017-06-02 08:44:38',NULL,284,'oLx6DjtgeRGlFfG-hHxSrrqJuDUg','Johnwoo',1,1,NULL),(5491,'text','宝宝六个月，开始长牙，吃奶总是抗拒怎么办','2017-06-02 13:35:07',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY',NULL,1,1,460),(5492,'text','你好，吃奶抗拒是指不吃，不含还是会用乳头磨牙','2017-06-02 13:36:10',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5493,'text','吃一个奶阵就仰起头不吃了，怎么按也按不住，竖办起来走就好了','2017-06-02 13:37:08',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5494,'text','也没有嗝，就是仰着头不吃','2017-06-02 13:37:43',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5495,'text','宝宝的牙龈有肿吗？有用你的乳头磨牙的情况吗？有轻微的发烧发热吗？','2017-06-02 13:39:03',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5496,'text','你有看到压床上的白点点吗','2017-06-02 13:39:32',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5497,'text','有，今天下牙龈上有要张开的痕迹','2017-06-02 13:40:17',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5498,'text','因为我觉得你的描述也有可能是6个月时候的猛长期，吃奶反复，睡眠倒退，情绪烦躁','2017-06-02 13:41:32',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5499,'text','他不太用乳头磨牙，但是会用自己的手指一直摸下牙龈，感觉还挺用力，用牙胶也是一直啃，拿着什么都往嘴里放','2017-06-02 13:41:50',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5500,'text','不吃奶不睡觉的时候没有很烦躁的感觉，就是要睡觉了，很难哄，躺着拍也不行，抱在怀里也不行，吃奶也不行，就是竖抱到处走可以','2017-06-02 13:43:16',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5501,'text','如果还有萌牙的情况的话，建议把多买两个牙咬胶放在冰箱里冷藏，让孩子磨牙，因为牙龈肿会不舒服冷的牙咬胶有帮助消肿的作用，会让孩子舒服一点','2017-06-02 13:43:38',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5502,'text','只要一横抱吃奶，立马就打挺，就耍赖','2017-06-02 13:44:02',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5503,'text','好的，我这就放冰箱去','2017-06-02 13:44:27',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5504,'text','是的，这个阶段的孩子不喜欢躺抱，因为视角不一样，竖着的视线更广','2017-06-02 13:44:43',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5505,'text','注意牙咬胶的卫生','2017-06-02 13:44:59',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5506,'text','可以看到他牙龈侧面发白，两小块','2017-06-02 13:45:31',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5507,'text','好的，谢谢','2017-06-02 13:45:38',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5508,'text','那怎样能让他吃奶顺利一些呢？','2017-06-02 13:46:13',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5509,'text','所以观察孩子睡眠的信号很重要，比如竖抱感觉已经很困了就可以奶睡过着哄睡','2017-06-02 13:46:23',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5510,'text','刚刚就是竖抱感觉他很安静了，横抱吃奶吧，吃了一个奶阵立马打挺','2017-06-02 13:46:59',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5511,'text','/::L','2017-06-02 13:47:03',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5512,'text','清醒的时候生活安排丰富一点比如趴着玩玩具呀，翻身等等多耗耗电','2017-06-02 13:47:39',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5513,'text','好的','2017-06-02 13:48:27',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5514,'text','竖抱要看他眼睛是不是要闭又闭不上的那种困的时候比较容易一点','2017-06-02 13:48:38',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5515,'text','他有时候在我怀里总是搓眼睛了，吃过奶阵以后还是打挺，我也是崩溃了','2017-06-02 13:49:32',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5516,'text','也不用太担心，这也是和妈妈磨合看看接下来辅食加了以后的奶量调整','2017-06-02 13:49:33',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5517,'text','对了，刚刚添辅食四天了','2017-06-02 13:49:52',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5518,'text','用母乳调的米粉','2017-06-02 13:50:02',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5519,'text','吃米粉倒是很开心，嘴巴还吧嗒吧嗒的','2017-06-02 13:50:24',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5520,'text','你别奔溃先要自己完全接受孩子的状态这样你的焦躁不会影响到他，要不然你的焦躁情绪也会传染给他的','2017-06-02 13:51:01',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5521,'text','嗯嗯，我努力控制好情绪','2017-06-02 13:51:26',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5522,'text','随着孩子的月龄增长，他清醒的时间也会比以前长，想要探索的东西也越来越多，所以适当的消耗才会让他愿意睡觉，如果总是吃了睡睡了吃，他肯定没有那么多瞌睡的','2017-06-02 13:53:09',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5523,'text','他现在晚上九点左右睡觉，早晨六点起床，上午睡一个半小时左右，下午睡两个小时左右，正常么','2017-06-02 13:54:16',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,1,NULL),(5524,'text','不用特别压抑自己，只要你觉得孩子的状态是正常的，接受他的变化','2017-06-02 13:54:22',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5525,'text','正常的','2017-06-02 13:54:44',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5526,'text','每个孩子的都不一样，但是看你孩子的情况还是规律的','2017-06-02 13:55:16',NULL,326,'oLx6Djla0UDm0bHLaMqEy0DuBTkY','haoweixin',1,2,NULL),(5527,'text','所以在他醒的时候丰富他的生活，消耗运动量，累了自然就睡了','2017-06-02 13:56:00',NULL,326,'oLx6Djla0UDm