',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,2,NULL),(5886,'text','不用自己买药。','2017-06-09 09:54:46',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,2,NULL),(5887,'text','看了医生的   看了几次都没有见好/:break','2017-06-09 09:55:34',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,1,NULL),(5888,'text','照片看上去有感染的迹象。保持清洁和干燥。医生怎么说？','2017-06-09 09:56:19',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,2,NULL),(5889,'text','嗯  \n一个医生说是擦太多  给配了药，有细菌感染的药，抹了一个星期没见好。现在换了个医生也说可能有霉菌感染  没做检查之类的  ','2017-06-09 10:05:43',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,1,NULL),(5890,'text','嗯！还是需要用药的','2017-06-09 10:06:12',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,2,NULL),(5891,'text','嗯  \n一个医生说是擦太多  给配了药，有细菌感染的药，抹了一个星期没见好。现在换了个医生说可能有霉菌感染  ，没做检查之类的  ，然后用奥青和湿润烧伤膏','2017-06-09 10:06:14',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,1,NULL),(5892,'text','三天也未见好转','2017-06-09 10:06:32',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,1,NULL),(5893,'text','还是老样子','2017-06-09 10:06:38',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,1,NULL),(5894,'text','可以问医生，不行换一家医院','2017-06-09 10:08:12',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,2,NULL),(5895,'text','是在省儿保吗？','2017-06-09 10:08:13',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,2,NULL),(5896,'text','第一次在儿保  第二次不是','2017-06-09 10:11:15',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,1,NULL),(5897,'text','谢谢哦','2017-06-09 10:11:17',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,1,NULL),(5898,'text','不客气。不要担心，换一家看看。这不是什么大问题，但是破皮的位置有点特殊，容易感染。','2017-06-09 10:12:32',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,2,NULL),(5899,'text','嗯  宝宝还小  便便是经常有  保持长时间干燥毕竟困难','2017-06-09 10:13:40',NULL,332,'oLx6DjgWg8NUKOZNlYZjieWz4XkM','Johnwoo',1,1,NULL),(5900,'text','七个月宝宝乳糖不耐受怎么办？','2017-06-09 11:03:30',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5901,'text','吃完奶粉或者母乳就腹泻','2017-06-09 11:03:40',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5902,'text','看到聊天记录里之前宝宝有腹泻，因为肠道病毒感染会引起暂时的继发性乳糖不耐受，慢慢自己也会修复，如果有继续母乳喂养那修复更快。如果这期间腹泻严重，也可以在每次喂奶前10-15分钟服用乳糖酶','2017-06-09 11:13:41',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5903,'text','乳糖酶那里有卖的？','2017-06-09 11:18:38',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5904,'text','现在每天吃完吃完母乳或者奶粉就会腹泻。','2017-06-09 11:19:11',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5905,'text','一天拉六七次，奶瓣和水','2017-06-09 11:19:29',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5906,'text','或者泡沫','2017-06-09 11:19:34',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5907,'text','就是因为之前的感染经历导致小肠粘膜受损（如果有滥用抗生素那就更加加剧了），出现暂时性的乳糖酶活性降低，所以代谢乳糖酶的能力下降，引发的腹泻。但这只是暂时性的，而且母乳中有很大一部分的成分是可以对受损的肠粘膜起到修复作用的。虽然，乳糖酶暂时受损，但是乳汁中的大量的低聚糖可以增强肠道内有益菌群的繁殖，乳汁中的活性物质修复受损的肠黏膜，这一切都只会让整个肠道环境尽快康复、乳糖酶尽快复活。','2017-06-09 11:23:04',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5908,'text','那为什么我每次喂完奶他就继续拉。','2017-06-09 11:24:06',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5909,'text','因为代谢乳糖酶的能力没这么快啊，我说这一段只是想提醒妈妈不要担心喂母乳，去医院或者药店给宝宝买乳糖酶，喂奶前补充乳糖酶也是国际上的推荐的做法，而不是改用腹泻奶粉，因为那个治标不治本，长期服用，因为毕竟热量低，营养会不够','2017-06-09 11:27:10',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5910,'text','好。谢谢。药店都有卖乳糖酶的吗？','2017-06-09 11:27:53',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5911,'text','不一定，可以先去问问','2017-06-09 11:28:27',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5912,'text','嗯。一般这个在哪卖？好着急。麻烦你给我说一下','2017-06-09 11:29:05',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5913,'text','购买药品的正规途径只有药店和医院药房啊','2017-06-09 11:29:58',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5914,'text','好。我去问问。谢谢你啦','2017-06-09 11:30:46',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5915,'text','乳糖酶就是只要喂奶前就给吃吗？一天吃几次？','2017-06-09 11:31:09',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5916,'text','我建议你还是去医院配吧，这样还能让医生确诊一下当下是否有无感染，还是单纯的继发性乳糖不耐受，毕竟我没有见到宝宝，只能凭你的文字描述。祝愿宝宝早日康复','2017-06-09 11:32:29',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5917,'image','[图片消息]','2017-06-09 11:33:06','I6VpS2aTA4BSNABl5d419kVdIf23VnsGw5EOJ6AZ074tY1PUVnlDNvjVb9dQXUJ5.jpg',317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5918,'text','你看一下不是感染','2017-06-09 11:33:12',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5919,'text','我们不能作医疗判断，谢谢','2017-06-09 11:33:56',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5920,'text','上次还帮我看了呢','2017-06-09 11:34:16',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5921,'text','/::-|','2017-06-09 11:34:21',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5922,'text','行吧。','2017-06-09 11:34:24',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5923,'text','乳糖酶一天吃几次？','2017-06-09 11:34:40',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5924,'text','喂奶前','2017-06-09 11:34:58',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5925,'text','只要一喂奶就给吃吗？那个对肠胃没有什么影响吧？','2017-06-09 11:35:28',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5926,'text','是。乳糖酶只是一种生物催化剂','2017-06-09 11:37:49',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(5927,'text','好。谢谢你','2017-06-09 11:37:56',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(5928,'text','我女儿现在9个月，指甲盖有白云','2017-06-10 15:11:29',NULL,145,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8',NULL,1,1,474),(5929,'text','是不是缺什么','2017-06-10 15:11:35',NULL,145,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8',NULL,1,1,474),(5930,'text','具体是什么样子的，拍来看一下','2017-06-10 15:22:10',NULL,145,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','haoweixin',1,2,NULL),(5931,'text','?，稍微等下','2017-06-10 16:06:48',NULL,145,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','haoweixin',1,1,NULL),(5932,'text','好的','2017-06-10 16:30:31',NULL,145,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','haoweixin',1,2,NULL),(5933,'image','[图片消息]','2017-06-10 23:53:39','9QbpUu8_M2NtSygYGS4m2xbHGKG8YHfmvGkOrOntMemrstzwCSvDxQHd4Ou0q3tf.jpg',145,'oLx6DjjxiC6i6jTxqhhs7kCpPyE8','ha