,'text','耳闻晚上37.8白天37.3','2017-06-20 10:22:28',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(6179,'text','持续低烧且孩子精神状态差的话，可就医','2017-06-20 10:23:23',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(6180,'text','这算低烧？','2017-06-20 10:23:40',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(6181,'text','精神不好','2017-06-20 10:23:47',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(6182,'text','临界吧','2017-06-20 10:24:39',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(6183,'text','精神不好，食欲不好。只吃母乳，其他的什么都不要，也不喝水','2017-06-20 10:25:01',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(6184,'text','同时也观察下口腔 手心 脚底有无小红颗粒','2017-06-20 10:25:54',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(6185,'text','如果有那是什么？','2017-06-20 10:26:16',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(6186,'text','手足口 疱疹性咽峡炎。。。不过这一类往往伴随38.5以上的高烧','2017-06-20 10:27:04',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(6187,'text','哦哦。没有','2017-06-20 10:28:05',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(6188,'text','太吓人了。发烧这么危险','2017-06-20 10:28:20',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(6189,'text','5岁以内，每年发烧个五六次是非常正常的，妈妈不必恐慌，可视为孩子的一种自我系统升级。重要的是妈妈如何调整正确的心态和正确的护理方式。','2017-06-20 10:29:56',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(6190,'text','昨天夜里我就不知道怎么给护理。孩子不让我给擦身上，也不让我敷头，一直哭鼻子','2017-06-20 10:31:31',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(6191,'text','物理降温不是必要的，物理降温的目的是让孩子舒服一点，如果他拒绝或者想睡觉了就不要勉强。多喝奶（获得更多活性抗体），多休息，才能更快康复','2017-06-20 10:33:10',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,2,NULL),(6192,'text','哦哦。他就是不让我弄。我给擦他就哭','2017-06-20 10:37:04',NULL,317,'oLx6DjsvyEoC_J7IyYOyX-RITkm8','zhaodan',1,1,NULL),(6193,'text','你好 我想问下有没有孕期运动？','2017-06-21 13:27:56',NULL,343,'oLx6DjjgWKOjJLWVxAPw3Se-RUM0',NULL,1,1,491),(6194,'text','你好，孕期运动有的','2017-06-21 13:28:58',NULL,343,'oLx6DjjgWKOjJLWVxAPw3Se-RUM0','haowei