L),(8040,'text','嗯嗯，我帮你解释一下我们产后康复的内容吧，也许会对你有帮助','2018-02-26 14:05:17',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,2,NULL),(8041,'text','嗯嗯','2018-02-26 14:05:31',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,1,NULL),(8042,'text','妈妈现在身高体重多少？','2018-02-26 14:06:33',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,2,NULL),(8043,'text','身高160体重60kg','2018-02-26 14:07:02',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,1,NULL),(8044,'text','嗯嗯，我们产后康复第一阶段的目标是增强核心肌群的力量，但是方式肯定不是大众健身房的卷腹啊，平板支撑之类的，因为产后妈妈的腹直肌还没有闭合，不合适的动作会加剧腹直肌的分离','2018-02-26 14:13:01',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,2,NULL),(8045,'text','增强核心肌群的力量，才能让妈妈在生活中的一些动作发力正确，减少更多用骨架支撑重量的情况，这样能减少腰酸背痛','2018-02-26 14:15:46',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,2,NULL),(8046,'text','通过合适的锻炼，减脂的过程中适当增肌。因为产后2年多了，不正确的发力方式也跟随了你很久了，在体态上肯定也有很多的影响，导致整个人看起来形态不好，所以也有调整体态的部分，例如调整骨盆前倾，o型腿，高低肩，假跨宽等体态问题','2018-02-26 14:20:06',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,2,NULL),(8047,'text','对','2018-02-26 14:20:43',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,1,NULL),(8048,'text','另外就是临床营养的部分，说白了就是指导你怎么吃，例如摄入热量，营养素的均衡等，会收益于妈妈和整个家庭','2018-02-26 14:22:32',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,2,NULL),(8049,'text','所以总的来说，我们做的是，先帮妈妈恢复健康的身体，再帮助妈妈恢复漂亮的身型/:v','2018-02-26 14:23:31',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,2,NULL),(8050,'text','可是也听过很多这方面的讲座，但是我们的情况是一家人一起吃，很多时候无法控制我吃什么','2018-02-26 14:23:46',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,1,NULL),(8051,'text','有时候在外婆家，有时候在奶奶家','2018-02-26 14:24:09',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,1,NULL),(8052,'text','这点更是难控制','2018-02-26 14:24:17',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,1,NULL),(8053,'text','嗯嗯，大部分的客户都是这样的情况，一家人一起吃，但是会有执行的方法噢','2018-02-26 14:24:27',NULL,711,'oQtTSs_VK3UkJaoL0Shze-BhyF4k','zhanghanjun',1,2,NULL),(8054,'text','特别是午餐，是工作餐','2018-02-26 14:24:31',NULL,711,'oQtTSs_VK3UkJaoL0Shze-Bh