,'text','你好','2018-03-13 16:47:59',NULL,773,'oQtTSs-0ExOxZa9If6ULl7i1O7vc','zhanghanjun',1,2,NULL),(8356,'text','四个月的宝宝吃奶不专心，量少','2018-03-13 17:08:34',NULL,775,'oQtTSs-XMXabggpgKxa4NgJnG3CY',NULL,1,1,951),(8357,'text','你好，四五个月开始，宝宝对外界环境都会表现出浓厚的兴趣和好奇心，发现外面的世界比吃奶更好玩，边吃边玩或者吃吃玩玩都是正常的，只要在生长曲线上体重增长在正常范围内，精神状态良好就不用太担心。','2018-03-13 17:11:40',NULL,775,'oQtTSs-XMXabggpgKxa4NgJnG3CY','HuangYuanYuan',1,2,NULL),(8358,'text','白天睡眠不好，晚上后半夜需要抱睡，怎么办呢？','2018-03-13 17:12:28',NULL,775,'oQtTSs-XMXabggpgKxa4NgJnG3CY','HuangYuanYuan',1,1,NULL),(8359,'text','妈妈晚上是母乳喂养吗？','2018-03-13 17:14:30',NULL,775,'oQtTSs-XMXabggpgKxa4NgJnG3CY','HuangYuanYuan',1,2,NULL),(8360,'text','纯母乳','2018-03-13 17:14:47',NULL,775,'oQtTSs-XMXabggpgKxa4NgJnG3CY','HuangYuanYuan',1,1,NULL),(8361,'text','妈妈与宝宝的睡眠方式是怎样的呢？如果宝宝生长发育都正常的话，建议妈妈可以放轻松一点来对待宝宝睡眠这件事，不过后半夜都要抱睡大人确实会很辛苦，妈妈有没有尝试其他安抚方式呢？这种情况是一直存在还是就最近出现的？','2018-03-13 17:18:28',NULL,775,'oQtTSs-XMXabggpgKxa4NgJnG3CY','HuangYuanYuan',1,2,NULL),(8362,'text','一阵一阵的，有时候又睡得很好，睡觉之前那顿瓶喂130左右，大概睡四个多小时到五个小时，后半夜就要枕着我的手才能睡','2018-03-13 17:20:15',NULL,775,'oQtTSs-XMXabggpgKxa4NgJnG3CY','HuangYuanYuan',1,1,NULL),(8363,'text','嗯，这个月龄的宝宝能连续睡四五个小时很棒了，对于婴儿连续五小时的睡眠我们就可以说他是能睡整觉了，后面宝宝再次进入深浅睡眠的交替中，需要安全感才能继续入睡，而且四个月开始宝宝的大动作发育又在进一步不断进步中，睡眠反复是有可能会经常发生，白天学会的技能，比如翻身、坐、到后期的爬行，都会在睡眠时进行整合，妈妈可以多多尝试不同的安抚技巧，放松心情','2018-03-13 17:26:59',NULL,775,'oQtTSs-XMXabggpgKxa4NgJnG3CY','HuangYuanYuan',1,2,NULL),(8364,'text','好的，太谢谢了，这么耐心的回答我','2018-03-13 17:32:53',NULL,775,'oQtTSs-XMXabggpgKxa4NgJnG3CY','HuangYuanYuan',1,1,NULL),(8365,'text','好的，太谢谢了，这么耐心的回答我','2018-03-13 17:32:53',NULL,775,'oQtTSs-XMXabggpgKxa4NgJnG3CY','HuangYuanYuan',1,1,NULL),(8366,'text','不客气，希望对你有所帮助[可爱][可爱]','2018-03-13 17:34:49',NULL,775,'oQtTSs-XMXabggpgKxa4NgJnG3CY','HuangYuanYuan',1,2,NULL),(8367,'text','咨询了商品-<a href=\"http://wp.theobmc.com/item?itemId=7\">分娩计划</a>','2018-03-14 15:06:46',NULL,777,'oQtTSs9dsWn9l0hMcwRsyA5Mt44M',NULL,1,1,952),(8368,'text','已经报名ibclc','2018-03-14 20:16:09',NULL,779,'oQtTSs3qBtzSz22QvGLzTUG2SREM',NUL