quot;;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;当孩子出生后，我们该如何创设一个能给孩子的身心灵以滋养的“类子宫”环境呢？家，对孩子而言不是一张床一口饭。它是富有生气的，能让孩子找到安全感和归属感的地方；是保护孩子专注力成长的地方；是辅助孩子探索这个世界的起点。&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;0-3&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;岁阶段的教育投入产出比最高，可也是“三不管”地带，绝大部分的家庭处于一个精养疏育的状态：终日扎在屎尿屁的圈圈里，更谈不上精神层面的科学育儿。&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;OBM&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;的理念是让婴幼儿早期教育回归家庭：将繁复的教育理论，重新设计成易习得的亲子游戏；针对每个家庭提出家庭环境创设方案，适配每个阶段孩子的成长需求；用视觉化的方式取代枯燥说教，完成对父母的吸引和教育。&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;关于宝宝：&lt;span&gt;1-6&lt;/span&gt;个月喂养、辅食添加（婴儿辅食临床营养计划）、感知觉发展、语言发展、大运动及精细运动发展、情感依恋发展等；&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;关于妈妈：产后抑郁情绪疏导、职场背奶、科学离乳等；&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;关于家庭：家庭环境创设、心理建设、关注原生家庭、正面沟通、家庭游戏、亲子阅读、后期的宝宝成长观察及家庭课堂。&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;OBM&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;家庭成长计划包含&lt;span&gt; 18 &lt;/span&gt;次家庭课堂及一对一服务。&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt; \n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;div&gt;\n	&lt;span style=&quot;font-size:14px;font-family:宋体;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-size:14px;font-family:Arial, sans-serif;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-size:14px;font-family:宋体;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:14px;&quot;&gt;&lt;/span&gt; \n&lt;/div&gt;'),(4,4,'&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p style=&quot;text-align:left;color:#3E3E3E;font-family:&amp;quot;Helvetica Neue&amp;quot;, Helvetica, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft YaHei&amp;quot;, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;&quot;&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-size:14.0pt;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;&quot;&gt;￥&lt;/span&gt;&lt;span style=&quot;font-size:14.0pt;font-family:&amp;quot;Bangla MN&amp;quot;;&quot;&gt;12800&lt;/span&gt;&lt;span style=&quot;font-size:14.0pt;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;&quot;&gt;元&lt;/span&gt;&lt;span style=&quot;font-size:14.0pt;font-family:&amp;quot;Bangla MN&amp;quot;;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-size:14.0pt;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;现代医学里并没有所谓的“月子病”；而普遍存在的产后腰痛、咳嗽大笑漏尿、“妈妈手”腱鞘炎等，往往是产后没有在恢复黄金期内进行专业而系统的康复运动，再加上错误的哺乳、抱娃姿势造成的肌肉劳损，和产后特殊的体态问题：腹直肌分离、盆底肌无力等造成的。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;由于妈妈孕期体内松弛激素的分泌，身体各部位尤其骨盆区域的肌肉、韧带等结缔组织和关节都会出现松弛的变化，产后康复运动除了减重和尽快恢复体形体态以外，增强腹部和盆底肌群的收缩力，降低腰背部疼痛和压力性尿失禁的风险，以及核心区域的收紧和肌肉张力的恢复也是非常重要的训练目标。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;有研究证实：适量运动能刺激多巴胺——令人愉悦的激素产生，有助于缓解产后抑郁情绪。饱满的精神状态和日渐改善的体形也会让妈妈在心理层面上倍感自信。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;迈开腿，管住嘴；三分练，七分吃。健康科学的瘦身计划必须是饮食与运动相结合的，所以&lt;span&gt;OBM&lt;/span&gt;产后康复计划也是配合临床营养计划，双管齐下，同步进行。既保证哺乳期妈妈的营养均衡，又必须规划好热量摄入。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;&quot;&gt;产后康复由&lt;span&gt;OBM&lt;/span&gt;孕产康复顾问根据妈妈产后康复情况进行一对一上门服务。该服务项目为&lt;span&gt;&lt;strong&gt;60&lt;/strong&gt;&lt;/span&gt;&lt;strong&gt;分钟&lt;/strong&gt;&lt;span&gt;&lt;strong&gt;/&lt;/strong&gt;&lt;/span&gt;&lt;strong&gt;次 &lt;/strong&gt;，共&lt;span&gt;&lt;strong&gt;16&lt;/strong&gt;&lt;/span&gt;&lt;strong&gt;次&lt;/strong&gt;一对一上门，包含&lt;span&gt;&lt;strong&gt;2&lt;/strong&gt;&lt;/span&gt;&lt;strong&gt;个月&lt;/strong&gt;的临床营养跟踪。&lt;/span&gt;\n&lt;/p&gt;'),(5,5,'&lt;p style=&quot;text-align:left;color:#3E3E3E;font-family:&amp;quot;Helvetica Neue&amp;quot;, Helvetica, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft YaHei&amp;quot;, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;&quot;&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;color:#555555;&quot;&gt;￥&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Bangla MN&amp;quot;;color:#555555;&quot;&gt;7200&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;&quot;&gt;元&lt;/span&gt;&lt;span style=&quot;font-family:&amp;quot;Bangla MN&amp;quot;;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;color:#555555;&quot;&gt;孕早期临床营养&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Bangla MN&amp;quot;;color:#F5A21A;&quot;&gt;600&lt;span style=&quot;color:#555555;&quot;&gt;元&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;span style=&quot;color:#555555;&quot;&gt;&lt;span&gt;／周，&lt;/span&gt;&lt;/span&gt;&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Bangla MN&amp;quot;;color:#F5A21A;&quot;&gt;12&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;color:#555555;&quot;&gt;周起售&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;在中国，普遍存在的现象是：刚一发现怀孕即各种大补；等到孕中期最舒适的时候又克制不住敞开了吃；待到孕晚期，也是胎儿最需要从母体摄入营养的时期，却又因为尴尬的增重配额早已破表（甚至是更为严峻的妊娠期糖尿病等病理问题），而不得不“黄瓜番茄度日”。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;近十年来，中国的巨大儿（&lt;span&gt;4&lt;/span&gt;公斤）出生率翻一倍；与之相对应的产妇患妊娠期糖尿病和剖宫产率也呈成倍递增趋势。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;其实，从临床营养学的角度来说，怀孕后并不需要吃“两个人的分量”，而是应该在保证母体营养均衡、胎儿发育正常的前提下，既能享受美食，同时也能科学合理地控制体重。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&amp;nbsp;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;OBM&lt;/span&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;孕产临床营养计划由&lt;span&gt;OBM&lt;/span&gt;临床营养博士团队负责，针对妈妈的饮食习惯及临床信息，按照不同的孕周时间，制定精确的营养餐食配比，严格控制孕期体重，均衡各营养素的有效补充，避免营养不良造成的医疗干预，防止巨大儿和孕期因过度补充带来的肥胖症，从而降低因为肥胖及营养过剩或营养不足带来的疾病风险（例如：妊娠糖尿病、妊娠高血压、甲状腺问题等）。&lt;/span&gt; \n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;div&gt;\n	&lt;span style=&quot;font-size:14px;font-family:宋体;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-size:14px;font-family:Arial, sans-serif;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-size:14px;font-family:宋体;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:14px;&quot;&gt;&lt;/span&gt; \n&lt;/div&gt;'),(6,6,'&lt;p style=&quot;text-align:left;color:#3E3E3E;font-family:&amp;quot;Helvetica Neue&amp;quot;, Helvetica, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft YaHei&amp;quot;, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;&quot;&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;color:#555555;&quot;&gt;￥&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Bangla MN&amp;quot;;color:#555555;&quot;&gt;26888&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;&quot;&gt;元&lt;/span&gt;&lt;span style=&quot;font-family:&amp;quot;Bangla MN&amp;quot;;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;color:#555555;&quot;&gt;尊享&lt;/span&gt;&lt;span style=&quot;font-family:&amp;quot;Bangla MN&amp;quot;;color:#555555;&quot;&gt;VIP&lt;/span&gt;&lt;span style=&quot;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;color:#555555;&quot;&gt;服务&lt;/span&gt;&lt;span style=&quot;font-family:&amp;quot;Bangla MN&amp;quot;;color:#555555;&quot;&gt;,&lt;/span&gt;&lt;span style=&quot;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;color:#555555;&quot;&gt;购买日至宝宝&lt;/span&gt;&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Bangla MN&amp;quot;;color:#F5A21A;&quot;&gt;6&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-family:&amp;quot;Lantinghei SC Extralight&amp;quot;;color:#555555;&quot;&gt;个月&lt;/span&gt;&lt;span style=&quot;font-family:&amp;quot;Bangla MN&amp;quot;;color:#555555;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;OBM 42 CARE&lt;/span&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;孕产育全程跟踪服务，从孕早期开始&lt;/span&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&amp;nbsp;5&lt;/span&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;大团队&lt;/span&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;（生育教育顾问、哺育顾问、临床营养顾问、孕产康复顾问、家庭成长顾问）&lt;/span&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;持续跟进服务。&lt;/span&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;strong&gt;【家访计划】&lt;/strong&gt;：孕期我们将根据妈妈的产检计划完成7次家访服务，服务内容主要针对妈妈的体重控制、分娩演习、体脂评估、产房布置、待产准备、哺育评估、家庭成长&lt;/span&gt;&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;……&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;strong&gt;【生育家庭课堂】&lt;/strong&gt;：完成&lt;span&gt;6&lt;/span&gt;个课时的一对一生育教育核心课程、完成分娩计划书避免不必要的医疗干预。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Bangla MN&amp;quot;;color:#555555;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;strong&gt;【临床营养计划】&lt;/strong&gt;：持续跟踪妈妈孕期的临床营养信息，指导如何有效的控制体重，避免巨大儿分娩带来的额外负担，完成产后&lt;span&gt;42&lt;/span&gt;天的临床营养计划（每周根据临床信息变换）。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;strong&gt;【哺育支持】&lt;/strong&gt;：完成产后&lt;span&gt;72&lt;/span&gt;小时的第一口奶、新生儿黄疸、生理性乳涨等&lt;span&gt;10&lt;/span&gt;次一对一服务以及产褥期的哺育支持及&lt;span&gt;0-6&lt;/span&gt;个月的喂养支持。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;strong&gt;【产后康复计划】&lt;/strong&gt;：孕产康复顾问完成从产褥期&lt;span&gt;10&lt;/span&gt;次产后康复一对一服务。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quot;&gt;&lt;strong&gt;【儿科体检】&lt;/strong&gt;：联合医疗机构全程关注完成宝宝&lt;span&gt;0-24&lt;/span&gt;个月的体检报告。&lt;span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;text-align:left;&quot;&gt;\n	&lt;span style=&quot;font-family:微软雅黑;color:#555555;&quo